query:
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?property ?propertyType ?propertyLabel ?propertyDescription WHERE {
?property wikibase:propertyType ?propertyType .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
} ORDER BY ASC(xsd:integer(STRAFTER(STR(?property), 'P')))

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?id ?idLabel ?idDescription ?new{
?id wikibase:directClaim ?pid .
minus{?id wikibase:propertyType wikibase:ExternalId}
BIND(Replace(STR(?id),"http://www.wikidata.org/entity/P"," ") as ?new)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
}
ORDER BY DESC(xsd:integer(?new))

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT (COUNT(?article) AS ?count)
WHERE {
?article wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:scholarly article]
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT (COUNT(?item) AS ?count)
WHERE { ?item wdt:[property:coordinate location] [] }

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?p ?pLabel ?pDescription WHERE {
?p wdt:[property:instance of] wd:[entity:human];
wdt:[property:sex or gender] wd:[entity:female];
{?p wdt:[property:place of birth] wd:[entity:United Kingdom]} # place of birth: UK
UNION {?p wdt:[property:place of birth] ?place.
{ ?place wdt:[property:located in the administrative territorial entity]?/wdt:[property:country] wd:[entity:United Kingdom] } # places whose country is the UK
UNION
{ ?place wdt:[property:located in the administrative territorial entity]*/wdt:[property:country]?/wdt:[property:instance of] wd:[entity:constituent country of the United Kingdom] } # places whose country is a constituent of the UK
}
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
} ORDER BY ?pLabel

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?p ?pLabel ?pDescription WHERE {
?p wdt:[property:instance of] wd:[entity:human];
wdt:[property:sex or gender] wd:[entity:female];
wdt:[property:place of birth] wd:[entity:United Kingdom].
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
} ORDER BY ?pLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT ?work ?title ?year ?english ?french WHERE {
?work wdt:[property:author] wd:[entity:Voltaire]
OPTIONAL{?work wdt:[property:publication date] ?pubdate}
BIND(YEAR(?pubdate) as ?year)
OPTIONAL{ ?english schema:about ?work ; schema:isPartOf <https://en.wikipedia.org/> }
OPTIONAL{ ?french schema:about ?work ; schema:isPartOf <https://fr.wikipedia.org/> }
OPTIONAL{ ?work rdfs:label ?title filter(lang(?title) = "en") }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?person ?name ?birthplace ?birthyear ?coord ?layer WHERE {
{?person wdt:[property:occupation] wd:[entity:economist]} UNION {?person wdt:[property:field of work] wd:[entity:economics]} MINUS {?person wdt:[property:occupation] wd:[entity:economist]; wdt:[property:field of work] wd:[entity:economics]}
?person wdt:[property:date of death] ?dod;
wdt:[property:place of birth] ?place .
?place wdt:[property:coordinate location] ?coord
OPTIONAL { ?person wdt:[property:date of birth] ?dob }
BIND(YEAR(?dob) as ?birthyear)
BIND(IF( (?birthyear < 1700), "Pre-1700", IF((?birthyear < 1751), "1700-1750", IF((?birthyear < 1801), "1751-1800", IF((?birthyear < 1851), "1801-1850", IF((?birthyear < 1901), "1851-1900", IF((?birthyear < 1951), "1901-1950", "Post-1950") ) ) ) )) AS ?layer )
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en".?person rdfs:label ?name. ?place rdfs:label ?birthplace }
} ORDER BY ?birthyear

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?name ?coord ?image ?workplace ?article WHERE {
?person wdt:[property:award received] wd:[entity:Prize in Economic Sciences in Memory of Alfred Nobel] ;
wdt:[property:employer] ?place .
?place wdt:[property:coordinate location] ?coord
OPTIONAL{ ?person wdt:[property:image] ?image }
OPTIONAL{ ?article schema:about ?person ; schema:isPartOf <https://en.wikipedia.org/> }
MINUS{ ?person wdt:[property:instance of]/wdt:[property:subclass of]? wd:[entity:fictional human] } # exclude fictional people
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". ?place rdfs:label ?workplace. ?person rdfs:label ?name}
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?name ?coord ?image ?almamater ?article WHERE {
?person wdt:[property:award received] wd:[entity:Prize in Economic Sciences in Memory of Alfred Nobel] ;
wdt:[property:educated at] ?place .
?place wdt:[property:coordinate location] ?coord
OPTIONAL{ ?person wdt:[property:image] ?image }
OPTIONAL{ ?article schema:about ?person ; schema:isPartOf <https://en.wikipedia.org/> }
MINUS{ ?person wdt:[property:instance of]/wdt:[property:subclass of]? wd:[entity:fictional human] } # Exclude fictional people
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". ?place rdfs:label ?almamater. ?person rdfs:label ?name}
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?person ?name ?birthyear ?deathyear ?enws ?quotes ?commonscat
(URI(CONCAT("https://www.gutenberg.org/ebooks/author/", ?gutenberg_id)) AS ?gutenberg)
(URI(CONCAT("https://doi.org/10.1093/ref:odnb/", ?odnb)) AS ?odnburl)
(URI(CONCAT("http://onlinebooks.library.upenn.edu/webbin/book/lookupname?key=", ?books)) AS ?booksurl)
(URI(CONCAT("https://www.britannica.com/", ?britannica)) AS ?britannicaurl) ?npg WHERE {
{ ?person wdt:[property:occupation] wd:[entity:economist] }
UNION
{ ?person wdt:[property:field of work] wd:[entity:economics] }
OPTIONAL {?person wdt:[property:Project Gutenberg author ID] ?gutenberg_id}
OPTIONAL { ?person wdt:[property:Online Books Page author ID] ?books }
OPTIONAL {
?enws schema:about ?person;
schema:isPartOf <https://en.wikisource.org/>
}
FILTER (BOUND(?enws) || BOUND(?gutenberg_id) || BOUND(?books))
OPTIONAL { ?person wdt:[property:date of death] ?death }
BIND(YEAR(?death) AS ?deathyear)
OPTIONAL { ?person wdt:[property:date of birth] ?birth }
BIND(YEAR(?birth) AS ?birthyear)
OPTIONAL { ?person wdt:[property:Encyclopædia Britannica Online ID] ?britannica }
OPTIONAL { ?person wdt:[property:National Portrait Gallery (London) person ID] ?npg }
OPTIONAL { ?person wdt:[property:Commons category] ?commonscat }
OPTIONAL {
?quote schema:about ?person;
schema:isPartOf <https://en.wikiquote.org/>
}
OPTIONAL { ?person wdt:[property:Oxford Dictionary of National Biography ID] ?odnb }
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". ?person rdfs:label ?name }
}
ORDER BY ?deathyear

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?person ?personLabel ?award ?awardLabel ?year WHERE {
?person p:[property:award received] ?statement.
?statement ps:[property:award received] ?award.
?award wdt:[property:instance of] wd:[entity:economics award]
MINUS { ?person wdt:[property:occupation] wd:[entity:economist] }
MINUS{ ?person wdt:[property:instance of]/wdt:[property:subclass of]? wd:[entity:fictional human] } # exclude fictional people
OPTIONAL { ?statement pq:[property:point in time] ?date. BIND(YEAR(?date) AS ?year) }
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
} ORDER BY ASC(?awardLabel) ASC(?year)

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?countryLabel ?postLabel ?post WHERE {
?post wdt:[property:subclass of] wd:[entity:finance minister];
wdt:[property:country] ?country
MINUS{ ?post wdt:[property:dissolved, abolished or demolished date] [] } # Exclude abolished posts
OPTIONAL{ ?post wdt:[property:applies to jurisdiction] ?jurisdiction }
FILTER( !(BOUND(?jurisdiction) && ?jurisdiction != ?country) )
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
} ORDER BY ?countryLabel

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?item ?itemLabel ?start ?end ?image ?link ?partyLabel WHERE {
?item p:[property:position held] ?s.?s ps:[property:position held] wd:[entity:Chancellor of the Exchequer].
?s pq:[property:start time] ?start. OPTIONAL {?s pq:[property:end time] ?end}
OPTIONAL {?item wdt:[property:image] ?image}
OPTIONAL {?item wdt:[property:Encyclopædia Britannica Online ID] ?id}
OPTIONAL {?item wdt:[property:member of political party] ?party}
BIND(IF(BOUND(?id), URI(CONCAT("https://www.britannica.com/",?id)) , ?item) AS ?link)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
} ORDER BY ?start

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?item ?itemLabel ?start ?end ?image ?link ?nominatedLabel WHERE {
?item p:[property:position held] ?s.?s ps:[property:position held] wd:[entity:Chair of the Federal Reserve].
?s pq:[property:start time] ?start. OPTIONAL {?s pq:[property:end time] ?end}
OPTIONAL {?item wdt:[property:image] ?image}
OPTIONAL {?item wdt:[property:Encyclopædia Britannica Online ID] ?id}
OPTIONAL {?s pq:[property:nominated by] ?nominated}
BIND(IF(BOUND(?id), URI(CONCAT("https://www.britannica.com/",?id)) , ?item) AS ?link)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
} ORDER BY ?start

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?c ?cLabel ?item ?itemLabel WHERE {
?item wdt:[property:instance of] wd:[entity:free trade area].
?c wdt:[property:member of] ?item
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
} ORDER BY ?itemLabel

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?iso ?countryLabel (SUM(?stars) as ?stars) ?fertility WHERE {
{SELECT DISTINCT ?country ?iso WHERE {
VALUES ?countrytypes {wd:[entity:country] wd:[entity:sovereign state]} # country and sovereign state
?country wdt:[property:instance of] ?countrytypes ; wdt:[property:ISO 3166-1 alpha-3 code] ?iso
MINUS {?country wdt:[property:dissolved, abolished or demolished date] []} # Not dissolved
} }
?country wdt:[property:flag] ?flag.
OPTIONAL{
?flag p:[property:depicts] [ps:[property:depicts] ?feature ; pq:[property:quantity] ?stars] . # quantity of feature
?feature wdt:[property:subclass of]? wd:[entity:star polygon] # type of star polygon
}
OPTIONAL { ?country wdt:[property:total fertility rate] ?fertility }
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
} GROUP BY ?iso ?countryLabel ?fertility
ORDER BY DESC(?stars) ?countryLabel

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?web ?collegeLabel (IF(BOUND(?hq), ?hq, ?coord) as ?location) ?arms WHERE {
{?college wdt:[property:instance of] wd:[entity:college of the University of Oxford]} UNION {?college wdt:[property:instance of] wd:[entity:Permanent Private Hall]}
MINUS {?college wdt:[property:dissolved, abolished or demolished date] []}
OPTIONAL { ?college p:[property:headquarters location]/pq:[property:coordinate location] ?hq }
OPTIONAL { ?college wdt:[property:coordinate location] ?coord }
?college wdt:[property:coat of arms image] ?arms;
wdt:[property:official website] ?web
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT (COUNT(?alum) AS ?count)
WHERE
{
?alum wdt:[property:educated at] wd:[entity:University of Oxford].
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT (COUNT(?alum) AS ?count)
WHERE {
{ ?alum wdt:[property:educated at] wd:[entity:University of Oxford] }
UNION { ?alum wdt:[property:educated at]/wdt:[property:instance of] wd:[entity:college of the University of Oxford] }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?alum ?alumLabel ?alumDescription ?college ?collegeLabel
WHERE {
?alum wdt:[property:instance of] wd:[entity:fictional human]
{?alum wdt:[property:educated at] wd:[entity:University of Oxford] }
UNION {?college wdt:[property:instance of] wd:[entity:college of the University of Oxford].
?alum wdt:[property:educated at] ?college}
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?alum ?alumLabel ?collegeLabel ?org ?orgLabel
WHERE {
{?alum wdt:[property:educated at] wd:[entity:University of Oxford] }
UNION { {?college wdt:[property:instance of] wd:[entity:college of the University of Oxford]} UNION {?college wdt:[property:instance of] wd:[entity:Permanent Private Hall]}.
?alum wdt:[property:educated at] ?college.}
?org wdt:[property:founded by] ?alum.
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
} ORDER BY ASC(?alumLabel)

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?alum ?alumLabel ?award ?awardLabel
WHERE {
{?alum wdt:[property:educated at] wd:[entity:University of Oxford] }
UNION {?college wdt:[property:instance of] wd:[entity:college of the University of Oxford].
?alum wdt:[property:educated at] ?college}
?alum wdt:[property:award received] ?award.
?alum wdt:[property:sex or gender] wd:[entity:female] .
MINUS { ?alum wdt:[property:country of citizenship] wd:[entity:United Kingdom] }
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
} ORDER BY ASC(?awardLabel)

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?alum ?alumLabel ?alumDescription ?image
WHERE {
{?alum wdt:[property:educated at] wd:[entity:University of Oxford] .}
UNION {?college wdt:[property:instance of] wd:[entity:college of the University of Oxford].
?alum wdt:[property:educated at] ?college.}
?alum wdt:[property:sex or gender] wd:[entity:female] .
MINUS { ?alum wdt:[property:country of citizenship] wd:[entity:United Kingdom] }.
OPTIONAL {?alum wdt:[property:image] ?image }.
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?alum ?alumLabel ?collegeLabel ?discovered ?discoveredLabel
WHERE {
{?alum wdt:[property:educated at] wd:[entity:University of Oxford] }
UNION { { ?college wdt:[property:instance of] wd:[entity:college of the University of Oxford] } UNION { ?college wdt:[property:instance of] wd:[entity:Permanent Private Hall] }
?alum wdt:[property:educated at] ?college }
?discovered wdt:[property:discoverer or inventor] ?alum
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
} ORDER BY ASC( ?alumLabel )

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?winner ?winnerLabel ?winnerDescription
WHERE {
?winner wdt:[property:award received] wd:[entity:Bodley Medal].
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?place ?placeLabel (SAMPLE(?loc) AS ?location) ?layer WHERE {
?place wdt:[property:located in the administrative territorial entity] wd:[entity:Oxford];
wdt:[property:instance of] ?type.
MINUS { ?place wdt:[property:dissolved, abolished or demolished date] [] } # Not closed down
OPTIONAL { ?place wdt:[property:coordinate location] ?coords }
OPTIONAL { ?place p:[property:headquarters location]/pq:[property:coordinate location] ?hqcoords }
BIND (IF (BOUND(?coords), ?coords, ?hqcoords) AS ?loc)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". ?type rdfs:label ?layer.?place rdfs:label ?placeLabel }
} GROUP BY ?place ?placeLabel ?layer

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?person ?personLabel (SAMPLE(?img) AS ?image) (SAMPLE(?loc) AS ?location) ?placeLabel WHERE {
?place wdt:[property:located in the administrative territorial entity] wd:[entity:Oxford];
wdt:[property:named after] ?person FILTER (?person != wd:[entity:Oxford]).
OPTIONAL { ?place wdt:[property:coordinate location] ?coords }
OPTIONAL { ?place p:[property:headquarters location]/pq:[property:coordinate location] ?hqcoords }
BIND (IF (BOUND(?coords), ?coords, ?hqcoords) AS ?loc)
OPTIONAL { ?person wdt:[property:image] ?img }
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
} GROUP BY ?person ?personLabel ?placeLabel

PREFIX schema: <http://schema.org/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT ?person ?enws WHERE {
?person wdt:[property:instance of] wd:[entity:human].
?enws schema:about ?person;
schema:isPartOf <https://en.wikisource.org/> FILTER CONTAINS(STR(?enws), "Author:")
} ORDER BY ?enws

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?thing ?thingLabel (GROUP_CONCAT(DISTINCT ?year; separator=", ") as ?years) ?shelfmark (GROUP_CONCAT(DISTINCT ?langLabel ; separator=", ") as ?languages) WHERE {
{ ?thing wdt:[property:collection] wd:[entity:Bodleian Library]} UNION { ?thing p:[property:inventory number]/pq:[property:collection] wd:[entity:Bodleian Library] } #wd:[entity:Bodleian Libraries]
OPTIONAL {?thing wdt:[property:inventory number] ?shelfmark}
OPTIONAL {?thing wdt:[property:inception] ?date. BIND(YEAR(?date) AS ?year) }
OPTIONAL {?thing wdt:[property:language of work or name] ?lang }
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" . ?thing rdfs:label ?thingLabel . ?lang rdfs:label ?langLabel }
} GROUP BY ?thing ?thingLabel ?shelfmark
