SELECT ?type ?typeLabel (COUNT(?ws) as ?count) (COUNT(?date) as ?have_date)
WHERE {
?article schema:about ?ws;
schema:isPartOf <https://en.wikisource.org/>.
?ws wdt:[property:instance of] ?type
OPTIONAL {?ws wdt:[property:publication date] ?date}
MINUS {?type wdt:[property:subclass of]+ wd:[entity:Wikimedia internal item]}
MINUS {?type wdt:[property:subclass of] wd:[entity:Wikimedia project page]}
MINUS {?type wdt:[property:subclass of]+ wd:[entity:Wikimedia page outside the main knowledge tree]}
OPTIONAL {?type rdfs:label ?typeLabel filter(lang(?typeLabel) = "en") }
} GROUP BY ?type ?typeLabel
