select ?parliament ?parliamentLabel ?job ?jobLabel ?s
WITH {
SELECT (COUNT(?sen) AS ?sens) ?job ?parliament WHERE {
?sen wdt:[property:position held] ?parliament;
wdt:[property:occupation] ?job.
?parliament wdt:[property:subclass of]* wd:[entity:member of parliament]
FILTER (?job != wd:[entity:politician])
} GROUP BY ?job ?parliament HAVING (?sens > 1)
} AS %subquery
WHERE{
{
SELECT ?parliament (MAX(?sens) AS ?s) WHERE{
INCLUDE %subquery
} GROUP BY ?parliament
}
INCLUDE %subquery
FILTER(?s = ?sens)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" }
} ORDER BY DESC(?s)

