(CONCAT(?rgpad,STR(?rg),?rgord,"-most farthest places") AS ?rank_group)
WHERE {
{ SELECT ?mun (SAMPLE(?loc) AS ?loc)
WHERE { ?mun wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:municipality];
wdt:[property:located in the administrative territorial entity] wd:[entity:Landkreis Leipzig];
