?film wdt:[property:instance of] wd:[entity:film];
wdt:[property:genre] ?g, ?g.
?g rdfs:label ?gL.
?film wdt:[property:director] ?director;
wdt:[property:director]7 ?date.
FILTER((LANG(?gL)) = "en")
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
