PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?awardCount ?award ?awardLabel WHERE {
{
SELECT (COUNT(?award) AS ?awardCount) ?award
WHERE
{
{
SELECT (SAMPLE(?human) AS ?human) ?award ?awardWork (SAMPLE(?director) AS ?director) (SAMPLE(?awardEdition) AS ?awardEdition) (SAMPLE(?time) AS ?time) WHERE {
?award wdt:[property:instance of] wd:[entity:Academy Awards] . # All items that are instance of([property:instance of]) of Academy awards ([entity:Academy Awards])
{
?human p:[property:award received] ?awardStat . # Humans with an awarded([property:award received]) statement
?awardStat ps:[property:award received] ?award . # ... that has any of the values of ?award
?awardStat pq:[property:statement is subject of] ?awardEdition . # Get the award edition (which is "subject of" XXth Academy Awards)
?awardStat pq:[property:for work] ?awardWork . # The work they have been awarded for
?human wdt:[property:instance of] wd:[entity:human] . # Humans
} UNION {
?awardWork wdt:[property:instance of] wd:[entity:film] . # Films
?awardWork p:[property:award received] ?awardStat . # ... with an awarded([property:award received]) statement
?awardStat ps:[property:award received] ?award . # ... that has any of the values of ?award
?awardStat pq:[property:statement is subject of] ?awardEdition . # Get the award edition (which is "subject of" XXth Academy Awards)
}
OPTIONAL {
?awardEdition wdt:[property:point in time] ?time . # the "point of time" of the Academy Award
?awardWork wdt:[property:director] ?director .
}
}
GROUP BY ?awardWork ?award # We only want every movie once for a category (a 'random' person is selected)
}
} GROUP BY ?award
ORDER BY ASC(?awardCount)
}
SERVICE wikibase:label { # ... include the labels
bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" .
}
}

