PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?item ?itemLabel ?high ?highl ?high_elevation ?low ?lowl ?low_elevation ?span WHERE {
#?item wdt:[property:instance of] wd:[entity:member states of the United Nations] .
?item wdt:[property:highest point] ?high .
?item p:[property:highest point] ?high_statement .
{ ?high wdt:[property:elevation above sea level] ?high_elevation } UNION { ?high_statement pq:[property:elevation above sea level] ?high_elevation }
OPTIONAL { ?high rdfs:label ?highl filter (lang(?highl) = "en") . }
?item wdt:[property:lowest point] ?low .
?item p:[property:lowest point] ?low_statement .
?low_statement pq:[property:elevation above sea level] ?low_elevation .
OPTIONAL { ?low rdfs:label ?lowl filter (lang(?lowl) = "en") . }
BIND( ?high_elevation - ?low_elevation as ?span )
SERVICE wikibase:label {
bd:serviceParam wikibase:language "en" .
}
} ORDER BY DESC(?span) DESC(?low_elevation) DESC(?high_elevation) ?high ?itemLabel

