?item wdt:[property:date of death] ?time0 .
FILTER ( ?time0 >= "1945-01-01T00:00:00Z"^^xsd:dateTime && ?time0 <= "1945-12-31T00:00:00Z"^^xsd:dateTime ) .
} GROUP BY ?item
}
SERVICE wikibase:label {
