PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT DISTINCT
?item
(SAMPLE (?titleL) AS ?title)
(group_concat(distinct ?creatorL ; separator = ", ") as ?creator)
(group_concat(distinct ?genreL ; separator = ", ") as ?genre)
(group_concat(distinct ?placeL ; separator = ", ") as ?place)
(group_concat(distinct ?arr ; separator = ", ") as ?arrondissement)
(SAMPLE (?img) AS ?image)
(SAMPLE (?coord) AS ?coordinates)
{
SELECT ?item ?titleL ?creatorL ?genreL ?placeL ?arr ?img ?coord
WHERE {
# selecting items...
{
# items in Paris...
?item wdt:[property:located in the administrative territorial entity] wd:[entity:Paris] .
} UNION {
# ...or in an arrondissement of Paris
?item wdt:[property:located in the administrative territorial entity]/wdt:[property:located in the administrative territorial entity]* wd:[entity:Paris] .
}
# genre: public art
?item wdt:[property:genre] wd:[entity:public art] .
# creators
OPTIONAL {
?item wdt:[property:creator] ?c.
?c rdfs:label ?creatorL filter (lang(?creatorL) = "fr") .
}
#genre
OPTIONAL {
{
?item wdt:[property:genre] ?g .
FILTER ( STR(?g) != 'http://www.wikidata.org/entity/[entity:public art]')
} UNION {
?item wdt:[property:instance of] ?g .
}
?g rdfs:label ?genreL filter (lang(?genreL) = "fr") .
}
# place
OPTIONAL {
?item wdt:[property:location] ?p .
?p rdfs:label ?placeL filter (lang(?placeL) = "fr") .
}
# arrondissement
OPTIONAL {
?item wdt:[property:located in the administrative territorial entity] ?a .
?a wdt:[property:located in the administrative territorial entity] wd:[entity:Paris] .
?a rdfs:label ?arrL filter (lang(?arrL) = "fr").
BIND(REPLACE(?arrL, '^([0-9]+).*$', "$1", "si") AS ?arr)
}
# image
OPTIONAL {?item wdt:[property:image] ?img.}
# coordinates
OPTIONAL {?item wdt:[property:coordinate location] ?coord.}
# title
OPTIONAL {?item rdfs:label ?titleL filter (lang(?titleL) = "fr") .}
} ORDER BY xsd:integer(?arr) ?titleL ?genreL ?createurL ?lieuL
}
GROUP BY ?item
ORDER BY xsd:integer(REPLACE(?arrondissement,'^([0-9]+),.*$', "$1", "si")) ?place ?title

