PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?genus (AVG(?period) AS ?period) (SAMPLE(?label) AS ?genusLabel) (SAMPLE(?rgb) AS ?rgb)
WHERE
{
{
BIND("en" AS ?language).
# find species with gestation period and convert to seconds (SI base unit)
?species p:[property:gestation period]/psv:[property:gestation period] [
wikibase:quantityAmount ?basePeriod;
wikibase:quantityUnit [
p:[property:conversion to SI unit]/psv:[property:conversion to SI unit] [
wikibase:quantityAmount ?unitPeriod;
wikibase:quantityUnit wd:[entity:second]
]
]
].
# convert back to days
BIND((?basePeriod * ?unitPeriod)/(60*60*24) AS ?period).
# find genus
?species wdt:[property:parent taxon]* ?genus.
?genus wdt:[property:taxon rank] wd:[entity:genus].
# find a good label - trivial name, else label, else "<no name>"
OPTIONAL {
?genus wdt:[property:taxon common name] ?trivialName.
FILTER(LANG(?trivialName) = ?language).
}
OPTIONAL {
?genus rdfs:label ?genusLabel.
FILTER(LANG(?genusLabel) = ?language).
}
BIND(IF(BOUND(?trivialName),?trivialName,IF(BOUND(?genusLabel),?genusLabel,"<no name>")) AS ?label).
# find order
?genus wdt:[property:parent taxon]* ?order.
?order wdt:[property:taxon rank] wd:[entity:order].
# choose "random but deterministic" color per order; you can play around with "-" (can be any string) to find a pleasing resulting color distribution
BIND(UCASE(SUBSTR(SHA256(CONCAT("-", STR(?order))), 0, 6)) AS ?rgb).
}
UNION
{
# add scale
VALUES (?genus ?period ?label) {
(wd:[entity:week] 7 "week"@en)
(wd:[entity:month] 30.436875 "month"@en)
(wd:[entity:quarter] 91.310625 "3 months"@en)
(wd:[entity:academic term] 182.62125 "6 months"@en)
(wd:[entity:year] 365.2425 "year"@en)
}
BIND("CCCCCC" AS ?rgb).
}
}
GROUP BY ?genus

