PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pqv: <http://www.wikidata.org/prop/qualifier/value/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?aliveSpouse ?aliveSpouseLabel ?deadSpouse ?deadSpouseLabel ?death ?marriage
WHERE
{
# ?aliveSpouse has spouse ?deadSpouse, with qualifier start time: ?marriage
?aliveSpouse p:[property:spouse] [ ps:[property:spouse] ?deadSpouse;
pqv:[property:start time] [
wikibase:timeValue ?marriage;
wikibase:timePrecision ?marriagePrecision
]
].
# ?deadSpouse has date of death ?death
?deadSpouse p:[property:date of death]/psv:[property:date of death] [
wikibase:timeValue ?death;
wikibase:timePrecision ?deathPrecision
].
# ?death prior to ?marriage
FILTER(?death < ?marriage).
# Optional: remove results with missing precision -
# only include matches over a year apart, or where both statements are precise to the day
#FILTER(YEAR(?marriage) - YEAR(?death) > 1 ||
