?class wdt:[property:subclass of]+ wd:Q7184903 .
# hint:Prior hint:gearing "reverse".
} LIMIT 40000
} AS %abstractClasses
WITH {
SELECT DISTINCT ?class WHERE {
INCLUDE %physicalClasses .
INCLUDE %abstractClasses .
}
} AS %commonClasses
WITH {
SELECT DISTINCT ?class WHERE {
INCLUDE %commonClasses.
MINUS {
{ SELECT (?class AS ?parentClass) WHERE { INCLUDE %commonClasses. } }
?class wdt:[property:subclass of] ?parentClass.
}
}
} AS %reducedClasses
WHERE {
INCLUDE %reducedClasses .
?class wdt:[property:subclass of]* ?class1 .
hint:Prior hint:gearing "forward".
?class1 wdt:[property:subclass of] ?absClass .
?absClass wdt:[property:subclass of]* wd:Q7184903 .
hint:Prior hint:gearing "forward".
