?absClass wdt:[property:subclass of]* wd:[entity:physical object] .
hint:Prior hint:gearing "forward".
BIND (1 AS ?no_go) .
}
FILTER (!bound(?no_go)) .
?class1 wdt:[property:subclass of] ?physClass .
?physClass wdt:[property:subclass of]* wd:[entity:physical object] .
