PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX hint: <http://www.bigdata.com/queryHints#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?film ?filmLabel ?filmDescription (COUNT(DISTINCT ?headOfGovernmentLabel) AS ?count) (GROUP_CONCAT(DISTINCT CONCAT(?headOfGovernmentLabel, ", "@en, ?description); separator = "; ") AS ?headsOfGovernment) WHERE {
?film wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:film];
wdt:[property:publication date] ?publicationDate;
p:[property:cast member] ?headOfGovernmentStatement.
?headOfGovernmentStatement ps:[property:cast member] ?headOfGovernment.
OPTIONAL { ?headOfGovernmentStatement pq:[property:character role] ?character. ?character rdfs:label ?characterLabel. FILTER(LANG(?characterLabel) = "en") } # label service doesn't work for this one for some reason - perhaps the query optimizer is being stupid and moving the label service before this optional block, so that ?character isn't bound yet when the label service runs
?headOfGovernment wdt:[property:instance of] wd:[entity:human];
p:[property:position held] [
ps:[property:position held] ?position;
pq:[property:start time] ?startTime
].
?position wdt:[property:subclass of]+ wd:[entity:head of government].
FILTER(?startTime > ?publicationDate) # *future* head of government
FILTER NOT EXISTS {
?headOfGovernment p:[property:position held] [
ps:[property:position held] ?otherPosition;
pq:[property:start time] ?otherStartTime
].
?otherPosition wdt:[property:subclass of]+ wd:[entity:head of government].
FILTER(?otherStartTime < ?publicationDate) # not already a head of government (some people held multiple "head of government" offices, or the same one multiple times)
}
SERVICE wikibase:label {
bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en".
?film rdfs:label ?filmLabel;
schema:description ?filmDescription.
?headOfGovernment rdfs:label ?headOfGovernmentLabel.
?position rdfs:label ?positionLabel.
} hint:Prior hint:runLast false.
BIND(IF(BOUND(?characterLabel), CONCAT(?characterLabel, " / "@en, ?positionLabel), ?positionLabel) AS ?description)
}
GROUP BY ?film ?filmLabel ?filmDescription
HAVING(?count > 1)
ORDER BY DESC(?count) ASC(MIN(?publicationDate))

