wdt:[property:named after] ?person.
?person wdt:[property:instance of] wd:[entity:human].
OPTIONAL {
?person wdt:[property:sex or gender]/wdt:[property:subclass of]* wd:[entity:female].
BIND("female"@en AS ?female)
}
