PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?t ?value ?valueLabel ?rrLabel ?rr (SAMPLE(?image) as ?img)
WHERE
{
VALUES ?person {wd:[entity:Heinrich Mann]}
{?person wdt:[property:date of death] ?death .
?person ?prop ?t FILTER (datatype(?t)=xsd:dateTime) FILTER (?t <= ?death) .
?value wikibase:directClaim ?prop. }
UNION
{
?person ?q ?statement FILTER regex (STR(?q),"prop/P") . #exclude P:describedBy
?person wdt:[property:date of death] ?death .
?statement ?p ?t FILTER regex (STR(?p), "prop/qualifier/P") FILTER (datatype(?t)=xsd:dateTime) FILTER (?t <= ?death).
?statement ?r ?value FILTER regex (STR(?r),"prop/statement/") .
BIND(IRI(CONCAT(CONCAT(SUBSTR(STR(?r),1,29),"direct/"),SUBSTR(STR(?r),40))) as ?rprop)
?rr wikibase:directClaim ?rprop .
OPTIONAL {?value wdt:[property:image] ?image}
}
UNION { # author of / creator of
?value wdt:[property:author]|wdt:[property:editor]|wdt:[property:translator]|wdt:[property:P1773]|wdt:[property:creator]|wdt:[property:developer]|wdt:[property:director]|wdt:[property:cast member] ?person .
?person wdt:[property:date of death] ?death .
?person wdt:[property:date of birth] ?birth .
?value wdt:[property:director]1|wdt:[property:publication date]|wdt:[property:start time] ?t .
#FILTER ((?t <= ?death) &&(?t >= ?birth))
FILTER NOT EXISTS {?value wdt:[property:genre] wd:[entity:translation] .}
#FILTER NOT EXISTS {?value wdt:[property:edition or translation of] ?x }
#FILTER NOT EXISTS {?person wdt:[property:notable work] ?value } .
OPTIONAL {?value wdt:[property:published in] ?rr .}
OPTIONAL {?value wdt:[property:image] ?image .}
}
# UNION #Notable Works
# {
# ?person wdt:[property:notable work] ?rr ;
# wdt:[property:date of death] ?death ;
# wdt:[property:date of birth] ?birth .
# ?rr wdt:[property:publication date]|wdt:[property:director]1|wdt:[property:date of first performance] ?t FILTER ((?t <= ?death)&&(?t >= ?birth)).
# OPTIONAL {?rr wdt:[property:image] ?image .}
# }
UNION #discoverer or inventor
{
?rr wdt:[property:discoverer or inventor]|wdt:[property:named after] ?person .
?person wdt:[property:date of death] ?death ;
wdt:[property:date of birth] ?birth .
?rr wdt:[property:director]5|wdt:[property:director]1|wdt:[property:point in time] ?t FILTER ((?t <= ?death)&&(?t >= ?birth)).
OPTIONAL {?rr wdt:[property:image] ?image .}
}
UNION #architect
{
?rr wdt:[property:architect] ?person .
?person wdt:[property:date of death] ?death ;
wdt:[property:date of birth] ?birth .
?rr wdt:[property:director]1|wdt:[property:cast member]9 ?t FILTER ((?t <= ?death)&&(?t >= ?birth)).
OPTIONAL {?rr wdt:[property:image] ?image .}
}
UNION #composer
{
?rr wdt:[property:composer]|wdt:[property:named after] ?person .
?person wdt:[property:date of death] ?death ;
wdt:[property:date of birth] ?birth .
?rr wdt:[property:director]1|wdt:[property:date of first performance]|wdt:[property:publication date] ?t
FILTER ((?t <= ?death)&&(?t >= ?birth)).
OPTIONAL {?rr wdt:[property:image] ?image .}
}
SERVICE wikibase:label { bd:serviceParam wikibase:language "en, de, fr, de, ru". }
} GROUP BY ?t ?value ?rr ?rrLabel ?valueLabel
ORDER BY ?t

