SELECT
?book ?bookLabel
?density
?height
?width
?thickness
?weight
WITH {
SELECT * WHERE {
?book wdt:[property:instance of] wd:[entity:version, edition or translation] ;
p:[property:mass] / psn:[property:mass] / wikibase:quantityAmount ?weight ;
p:[property:height] / psn:[property:height] / wikibase:quantityAmount ?height ;
p:[property:width] / psn:[property:width] / wikibase:quantityAmount ?width ;
p:[property:thickness] / psn:[property:thickness] / wikibase:quantityAmount ?thickness .
BIND(?weight / (?height * ?width * ?thickness) AS ?density)
}
} AS %results
WHERE {
INCLUDE %results
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY ?density

