PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?item ?itemLabel ?countryLabel ?area ?population WHERE {
?item wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:first-level administrative division] ; # first-level subdivision
wdt:[property:country] ?country ; # country
p:[property:area]/psv:[property:area] [ # area
wikibase:quantityAmount ?baseArea;
wikibase:quantityUnit [
p:[property:conversion to SI unit]/psv:[property:conversion to SI unit] [
wikibase:quantityAmount ?unitArea;
wikibase:quantityUnit wd:[entity:square metre]
]
]
] ;
wdt:[property:population] ?population . # population
BIND(ROUND(?baseArea * ?unitArea / 1000000) AS ?area) .
FILTER ( ?area >= 400000 )
FILTER NOT EXISTS { ?item wdt:[property:dissolved, abolished or demolished date] ?x } # filter dissolved subdivisions
FILTER NOT EXISTS { ?country wdt:[property:dissolved, abolished or demolished date] ?x } # filter dissolved countries
SERVICE wikibase:label { bd:serviceParam wikibase:language "en" . }
}
ORDER BY DESC(?area)

