PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

select ?count ?human ?humanLabel ?humanDescription
WITH {
SELECT ?human (COUNT(DISTINCT ?article) AS ?count) WHERE {
?human wdt:[property:country of citizenship] wd:[entity:Denmark] .
?human wdt:[property:occupation] / wdt:[property:subclass of]* wd:[entity:athlete] .
?human wdt:[property:sex or gender] wd:[entity:female].
?article schema:about ?human .
}
GROUP BY ?human
} AS %results
WHERE {
INCLUDE %results
SERVICE wikibase:label { bd:serviceParam wikibase:language "da,en". }
}
ORDER BY DESC(?count)

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?place ?placeLabel ?location
WHERE
{
# Edinburgh coordinates
wd:[entity:Edinburgh] wdt:[property:coordinate location] ?EdinLoc .
SERVICE wikibase:around {
?place wdt:[property:coordinate location] ?location .
bd:serviceParam wikibase:center ?EdinLoc .
bd:serviceParam wikibase:radius "100" .
} .
# Is a battle
FILTER EXISTS { ?place wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:battle] } .
SERVICE wikibase:label {
bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en" .
}
}

PREFIX hint: <http://www.bigdata.com/queryHints#>
PREFIX schema: <http://schema.org/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?item ?sitelinks WHERE {
?item wikibase:sitelinks ?sitelinks. hint:Prior hint:rangeSafe true. # https://wiki.blazegraph.com/wiki/index.php/QueryHints
FILTER(?sitelinks >= 75) # arbitrary limit to optimize the query by removing most items (assuming that the desired results will have more statements than this)
MINUS {
?article schema:isPartOf <https://ca.wikipedia.org/>;
schema:about ?item.
}
MINUS { ?item wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:Wikimedia internal item]. } # remove templates etc.
}
ORDER BY DESC(?sitelinks)
LIMIT 10

