PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

select DISTINCT ?sLabel ?s ?legendLabel ?date ?image WHERE {
?s wdt:[property:part of]|wdt:[property:parent astronomical body]/wdt:[property:part of] wd:[entity:Solar System] . #Solar System }
?s wdt:[property:time of discovery or invention] ?date ; #discovery
wdt:[property:image] ?image .
?s p:[property:image] ?imgstatement .
OPTIONAL {?imgstatement pq:[property:of] ?legend .}
SERVICE wikibase:label
{ bd:serviceParam wikibase:language "en, fr, de, it". }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?human ?humanLabel ?positionLabel ?countryLabel WITH {
SELECT DISTINCT ?human ?position ?country WHERE {
?human wdt:[property:instance of] wd:[entity:human];
wdt:[property:sex or gender] wd:[entity:female];
wdt:[property:position held] ?position.
?position wdt:[property:subclass of]+ wd:[entity:minister];
wdt:[property:applies to jurisdiction] ?country.
?country wdt:[property:continent] wd:[entity:Africa].
}
} AS %results WHERE {
INCLUDE %results.
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}

PREFIX prov: <http://www.w3.org/ns/prov#>
PREFIX pr: <http://www.wikidata.org/prop/reference/>

SELECT ?statement ?reference ?quote
WITH {
SELECT ?reference WHERE {
?statement prov:wasDerivedFrom ?reference.
?reference pr:[property:quotation] ?quote;
?pr [].
}
GROUP BY ?reference
HAVING(COUNT(DISTINCT ?pr) = 1)
} AS %references
WHERE {
INCLUDE %references.
?statement prov:wasDerivedFrom ?reference.
?reference pr:[property:quotation] ?quote.
}

