PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?item ?itemLabel ?capitalLabel ?countryLabel ?coords WHERE {
?item wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:island] ;
wdt:[property:located in the administrative territorial entity]+ ?capital .
?capital p:[property:capital of] ?scapital .
?scapital ps:[property:capital of] ?country .
FILTER NOT EXISTS { ?scapital pq:[property:end time] ?x }
?country p:[property:instance of] ?scountry .
?scountry ps:[property:instance of] wd:[entity:country] .
FILTER NOT EXISTS { ?scountry pq:[property:end time] ?x }
OPTIONAL { ?item wdt:[property:coordinate location] ?coords }
SERVICE wikibase:label { bd:serviceParam wikibase:language "en" . }
} ORDER BY ?countryLabel ?capitalLabel ?itemLabel

