SELECT ?item ?itemLabel (COUNT(distinct ?sitelink) as ?count) (SAMPLE(?picture) as ?picture)
WHERE
{
?item wdt:[property:instance of] wd:[entity:human] .
?item wdt:[property:sex or gender] wd:[entity:female] .
?item wdt:[property:occupation] ?dancer .
VALUES ?dancer {
wd:[entity:human]716684
wd:[entity:ballet dancer]
wd:[entity:choreographer]
}
?item wdt:[property:image] ?picture .
?sitelink schema:about ?item .
FILTER EXISTS { ?wen schema:about ?item . ?wen schema:inLanguage "en" }
FILTER NOT EXISTS { ?wfr schema:about ?item . ?wfr schema:inLanguage "fr" }
SERVICE wikibase:label {
bd:serviceParam wikibase:language "fr,en" .
}
}
GROUP BY ?item ?itemLabel
ORDER BY DESC(?count)

