PREFIX schema: <http://schema.org/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?project ?femaleArticles ?allArticles ?percentFemale
WITH {
SELECT ?project (COUNT(DISTINCT ?article) AS ?femaleArticles) WHERE {
?article schema:isPartOf ?project;
schema:about ?item.
?project wikibase:wikiGroup "wikipedia".
?item wdt:[property:instance of] wd:[entity:human];
wdt:[property:sex or gender]/wdt:[property:subclass of]* wd:[entity:female];
wdt:[property:occupation]/wdt:[property:subclass of]* wd:[entity:scientist].
}
GROUP BY ?project
} AS %femaleArticles
WITH {
SELECT ?project (COUNT(DISTINCT ?article) AS ?allArticles) WHERE {
?article schema:isPartOf ?project;
schema:about ?item.
?project wikibase:wikiGroup "wikipedia".
?item wdt:[property:instance of] wd:[entity:human];
wdt:[property:occupation]/wdt:[property:subclass of]* wd:[entity:scientist].
}
GROUP BY ?project
} AS %allArticles
WHERE {
INCLUDE %femaleArticles.
INCLUDE %allArticles.
BIND(100*?femaleArticles/?allArticles AS ?percentFemale)
}
ORDER BY DESC(?femaleArticles)

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?subject ?subjectLabel ?propertyLabel ?objectLabel WHERE {
?property a wikibase:Property;
wikibase:claim ?p;
wikibase:statementProperty ?ps.
?subject ?p ?statement.
?statement ?ps ?object;
pq:[property:statement disputed by] ?subject.
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?item ?itemLabel ?location WHERE {
SERVICE wikibase:around {
?item wdt:[property:coordinate location] ?location.
bd:serviceParam wikibase:center "[AUTO_COORDINATES]";
wikibase:radius "1";
wikibase:distance ?dist.
}
?item rdfs:label ?itemLabel.
FILTER(LANG(?itemLabel) = "en")
FILTER NOT EXISTS {
?item rdfs:label ?frLabel.
FILTER(LANG(?frLabel) = "cy")
}
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?person ?personLabel ?personDescription ?placeOfBirthLabel ?educatedAtLabel (MAX(?distance) AS ?distance) WITH {
SELECT ?person ?placeOfBirth ?educatedAt ?distance WHERE {
?person wdt:[property:instance of] wd:[entity:human];
wdt:[property:date of birth] ?dateOfBirth;
wdt:[property:place of birth] ?placeOfBirth;
wdt:[property:educated at] ?educatedAt.
?placeOfBirth wdt:[property:coordinate location] ?placeOfBirthCoordinates.
?educatedAt wdt:[property:coordinate location] ?educatedAtCoordinates.
BIND(geof:distance(?placeOfBirthCoordinates, ?educatedAtCoordinates) AS ?distance).
}
ORDER BY DESC(?distance)
LIMIT 50
} AS %results WHERE {
INCLUDE %results.
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}
GROUP BY ?person ?personLabel ?personDescription ?placeOfBirthLabel ?educatedAtLabel
ORDER BY DESC(?distance)

