SELECT DISTINCT ?item ?itemLabel ?itemDescription
WHERE {
?item wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:Wikidata property] .
MINUS { ?item wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:Wikidata property for an identifier] .}
FILTER(NOT EXISTS {
?item rdfs:label ?lang_label.
FILTER(LANG(?lang_label) = "af")
})
SERVICE wikibase:label { bd:serviceParam wikibase:language "en,nl,fr,de,it,es,no,pt". }
}
ORDER BY ?itemLabel

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?humain ?humainLabel ?lieuNaissanceLabel ?lieuMortLabel ?occ ?archive_at
WITH { SELECT ?humain (group_concat(distinct ?occupLabel;separator=", ") as ?occ) (group_concat(distinct ?archiveLabel;separator=", ") as ?archive_at) WHERE
{
?humain wdt:[property:instance of] wd:[entity:human].
OPTIONAL {?humain wdt:[property:occupation] ?occup.
?occup rdfs:label ?occupLabel. filter(lang(?occupLabel)="fr")}
OPTIONAL {?humain wdt:[property:archives at] ?archive.
?archive rdfs:label ?archiveLabel. filter(lang(?archiveLabel)="fr")}
{?humain wdt:[property:place of birth] ?lieuNaissance.
?lieuNaissance wdt:[property:located in the administrative territorial entity] wd:[entity:canton Vaud].}
UNION
{?humain wdt:[property:place of death] ?lieuMort.
?lieuMort wdt:[property:located in the administrative territorial entity] wd:[entity:canton Vaud].}
} group by ?humain } as %i
WHERE {include %i
OPTIONAL {?humain wdt:[property:place of birth] ?lieuNaissance.}
OPTIONAL {?humain wdt:[property:place of death] ?lieuMort.}
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],fr". }
} ORDER BY ?humainLabel

