PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?item ?itemLabel ?location ?layer ?nearestitemLabel ?nearestitem
WITH {
SELECT ?bookcase ?location1 (MIN(?distance) AS ?minDistance) WHERE {
?bookcase wdt:[property:instance of] wd:[entity:public bookcase];
wdt:[property:coordinate location] ?location1;
wdt:[property:located in the administrative territorial entity] wd:[entity:Vienna].
?library wdt:[property:instance of] wd:[entity:public library];
wdt:[property:coordinate location] ?location2;
wdt:[property:located in the administrative territorial entity] wd:[entity:Vienna].
BIND(geof:distance(?location1, ?location2) AS ?distance)
}
GROUP BY ?bookcase ?location1
} AS %bookcasesWithDistance
WITH {
SELECT ?bookcase ?location1 ?library ?location2 ?distance WHERE {
INCLUDE %bookcasesWithDistance.
?library wdt:[property:instance of] wd:[entity:public library];
wdt:[property:coordinate location] ?location2;
wdt:[property:located in the administrative territorial entity] wd:[entity:Vienna].
BIND(geof:distance(?location1, ?location2) AS ?distance)
FILTER(?distance = ?minDistance)
}
} AS %bookcasesWithLibraries
WHERE {
INCLUDE %bookcasesWithLibraries.
VALUES ?switch { true false }
BIND(IF(?switch, "Bucherschrank"@de, "Bibliothek"@de) AS ?layer)
BIND(IF(?switch, ?bookcase, ?library) AS ?item)
BIND(IF(?switch, ?location1, ?location2) AS ?location)
BIND(IF(?switch, ?library, ?bookcase) AS ?nearestitem)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en,de". }
}

