PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?count ?work ?workLabel ?author ?authorLabel
WITH {
SELECT ?work ?author (COUNT(?citing_work) AS ?count) WHERE {
?work p:[property:author] ?author_statement .
?author_statement ps:[property:author] ?author .
?author_statement pq:[property:series ordinal] "1" .
?author (wdt:[property:affiliation] | wdt:[property:employer] ) / wdt:[property:country] wd:[entity:Sweden] .
?citing_work wdt:[property:cites work] ?work .
}
GROUP BY ?work ?author
} AS %results
WHERE {
INCLUDE %results
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY DESC(?count)

PREFIX bd: <http://www.bigdata.com/rdf#>
