PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?stateLabel ?item1 ?item1Label ?item2 ?item2Label
WITH {
SELECT DISTINCT ?state WHERE {
?state wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:sovereign state];
p:[property:member of] ?memberOfStatement.
?memberOfStatement a wikibase:BestRank;
ps:[property:member of] wd:[entity:United Nations].
MINUS { ?memberOfStatement pq:[property:end time] ?endTime. }
MINUS { ?state wdt:[property:dissolved, abolished or demolished date]|wdt:[property:end time] ?end. }
}
} AS %states
WHERE {
INCLUDE %states.
?state wdt:[property:office held by head of state] ?position.
?item1 wdt:[property:instance of] wd:[entity:human];
wdt:[property:position held] ?position;
wdt:[property:family name]/wdt:[property:native label] ?familyName1.
?item2 wdt:[property:instance of] wd:[entity:human];
wdt:[property:position held] ?position;
wdt:[property:family name]/wdt:[property:native label] ?familyName2.
FILTER(STR(?item1) < STR(?item2))
FILTER(SUBSTR(?familyName1, 1, 4) = SUBSTR(?familyName2, 1, 4))
FILTER(?familyName1 != ?familyName2)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY ?stateLabel

