SELECT DISTINCT ?place ?img ?twitter ?motivation ?article ?NobelArticle ?coord22 ?TED WHERE {
?laureate wdt:[property:exact match] ?laureate_nobel_uri .
OPTIONAL{?laureate wdt:[property:Twitter (X) username] ?twitterID}
?laureate wdt:[property:TED speaker ID] ?TEDID
FILTER (strStarts(str(?laureate_nobel_uri), "http://data.nobelprize.org/resource/laureate/"))
OPTIONAL {?laureate wdt:[property:image] ?img}
