OPTIONAL{?laureate wdt:[property:P3188] ?Na}
BIND (URI(CONCAT("https://www.nobelprize.org/nobel_prizes/",?Na,"-facts.html")) AS ?NobelArticle)
BIND (URI(CONCAT("https://twitter.com/",?twitterID)) AS ?twitter)
BIND (URI(CONCAT("https://www.ted.com/speakers/",?TEDID)) AS ?TED)
SERVICE <http://data.nobelprize.org/sparql> {
?laureate_nobel_uri nobel:laureateAward / nobel:motivation ?motivation .
