PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
PREFIX nobel: <http://data.nobelprize.org/terms/>

SELECT distinct ?id (sample(?name) AS ?name) (sample(?text) AS ?text) ?motivationen ?contribution ?Documentary ?Diploma ?Nobel_Lecture ?Prize_Presentation ?Biographical ?Banquet_Speech
(sample (?coord) AS ?coord)
(sample (?img) AS ?img)
(floor(?Year/10)*10 as ?layer)
WHERE {
SERVICE <http://data.nobelprize.org/sparql> {
?laureate_nobel_uri nobel:laureateAward ?NobelAwardid.
BIND(REPLACE(str(?laureate_nobel_uri),"http://data.nobelprize.org/resource/laureate/","") AS ?id)
OPTIONAL{?laureate_nobel_uri nobel:laureateAward / nobel:year ?Year}
OPTIONAL{?NobelAwardid rdfs:label ?text}
OPTIONAL{?NobelAwardid nobel:laureate/foaf:name ?name}
OPTIONAL{?NobelAwardid nobel:category ?category}
OPTIONAL{?NobelAwardid nobel:motivation ?motivationen
FILTER (lang(?motivationen) = 'en')
}
OPTIONAL {
?NobelAwardid nobel:contribution ?contribution
FILTER (lang(?contribution) = 'en')
}
OPTIONAL {
?NobelAwardid nobel:awardFile ?NobelAwardFileF.
?NobelAwardFileF nobel:fileType <http://data.nobelprize.org/resource/filetype/Documentary>.
?NobelAwardFileF rdfs:seeAlso ?Documentary
}
OPTIONAL {
?NobelAwardid nobel:awardFile ?NobelAwardFileD.
?NobelAwardFileD nobel:fileType <http://data.nobelprize.org/resource/filetype/Nobel_Diploma>.
?NobelAwardFileD rdfs:seeAlso ?Diploma
}
OPTIONAL { # 845 st
?NobelAwardid nobel:awardFile ?NobelAwardFileL.
?NobelAwardFileL nobel:fileType <http://data.nobelprize.org/resource/filetype/Nobel_Lecture>.
?NobelAwardFileL rdfs:seeAlso ?Nobel_Lecture
}
OPTIONAL { # 3 st
?NobelAwardid nobel:awardFile ?NobelAwardFileP.
?NobelAwardFileP nobel:fileType <http://data.nobelprize.org/resource/filetype/Prize_Presentation>.
?NobelAwardFileP rdfs:seeAlso ?Prize_Presentation
}
OPTIONAL { # 66 st
?NobelAwardid nobel:awardFile ?NobelAwardFileB.
?NobelAwardFileB nobel:fileType <http://data.nobelprize.org/resource/filetype/Biographical>.
?NobelAwardFileB rdfs:seeAlso ?Biographical
}
OPTIONAL {
?NobelAwardid nobel:awardFile ?NobelAwardFileBa.
?NobelAwardFileBa nobel:fileType <http://data.nobelprize.org/resource/filetype/Banquet_Speech>.
?NobelAwardFileBa rdfs:seeAlso ?Banquet_Speech
}
}
# Match with Wikidata [property:exact match] Exact match
?Wikidataid wdt:[property:exact match] ?laureate_nobel_uri.
?Wikidataid wdt:[property:place of birth]/wdt:[property:coordinate location] ?coord.
OPTIONAL {?Wikidataid wdt:[property:image] ?img}
BIND (?Year AS ?layer)
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
} group by ?id ?motivationen ?contribution ?Documentary ?Diploma ?Nobel_Lecture ?Prize_Presentation ?Biographical ?Banquet_Speech ?Year
?layer
order by desc(?Year)

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX geo: <http://www.opengis.net/ont/geosparql#>
PREFIX hint: <http://www.bigdata.com/queryHints#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?coordinates ?line ?station ?stationLabel ?connectLabel ?image ?opening ?rgb
WITH {
SELECT ?station ?coordinates ?image ?lat ?lon ?opening WHERE {
{
SELECT ?station (SAMPLE(?coord_stmt) AS ?coord_stmt) (SAMPLE(?image) AS ?image) (sample(?opening) as ?opening) WHERE {
?station wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:railway station] .
?station wdt:[property:part of] wd:[entity:Amsterdam Metro] .
?station p:[property:coordinate location] ?coord_stmt .
OPTIONAL { ?station wdt:[property:image] ?image }.
OPTIONAL { ?station wdt:[property:date of official opening] ?opening }.
} GROUP BY ?station
}
hint:SubQuery hint:optimizer "None".
?coord_stmt ps:[property:coordinate location] ?coordinates .
?coord_stmt psv:[property:coordinate location] / wikibase:geoLatitude ?lat .
?coord_stmt psv:[property:coordinate location] / wikibase:geoLongitude ?lon .
}
} AS %stations
WITH {
SELECT (?station AS ?nextstation) (?lat AS ?lat2) (?lon AS ?lon2) WHERE {
INCLUDE %stations
}
} AS %nextstations
WITH {
SELECT ?line ?connect ?rgb WHERE {
INCLUDE %stations .
INCLUDE %nextstations .
?station p:[property:adjacent station] ?nextstationstatement .
?nextstationstatement ps:[property:adjacent station] ?nextstation .
?nextstationstatement pq:[property:connecting line] ?connect . ?connect wdt:[property:part of] wd:[entity:Amsterdam Metro] .
?connect wdt:[property:sRGB color hex triplet] ?rgb .
FILTER(STR(?station) < STR(?nextstation)) .
BIND(CONCAT('LINESTRING (', STR(?lon), ' ', STR(?lat), ',', STR(?lon2), ' ', STR(?lat2), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line)
}
} AS %lines
WHERE {
{ INCLUDE %stations } UNION { INCLUDE %lines } .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX geo: <http://www.opengis.net/ont/geosparql#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT
?time ?end_time ?locationLabel ?point ?line
WITH {
SELECT ?subject ?location ?time ?end_time ?point ?point_str WHERE {
VALUES ?subject { wd:[entity:Philip de László] } .
?subject p:[property:work location] ?work_location_statement .
?work_location_statement ps:[property:work location] ?location .
?location p:[property:coordinate location] / ps:[property:coordinate location] ?point .
?location p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLatitude ?latitude .
?location p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLongitude ?longitude .
?work_location_statement pq:[property:start time] ?time .
OPTIONAL { ?work_location_statement pq:[property:end time] ?end_time } .
BIND(CONCAT(STR(?longitude), ' ', STR(?latitude)) AS ?point_str)
}
ORDER BY (?time)
} AS %points
WITH {
SELECT ?subject (STRDT( CONCAT('LINESTRING (', GROUP_CONCAT(?point_str; separator=','), ')'), geo:wktLiteral) AS ?line) WHERE {
INCLUDE %points
} GROUP BY ?subject
} AS %line
WHERE {
INCLUDE %points
INCLUDE %line
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?property ?propertyLabel ?count WHERE {
# First find other additional relations and their count:
{SELECT ?directProperty (COUNT(*) as ?count)
WHERE {
BIND( wdt:[property:spouse] as ?firstRelation) # spouse; can be changed to anything
?item ?firstRelation ?item2 .
?item ?directProperty ?item2
FILTER(?directProperty != ?firstRelation)
} GROUP BY ?directProperty
}
# Then find the property entity for this relation and fetch its label:
?property wikibase:directClaim ?directProperty
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
} ORDER BY DESC(?count)

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX geo: <http://www.opengis.net/ont/geosparql#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?coordinates ?line ?item ?itemLabel ?connectLabel ?image ?opening ?rgb
WITH {
SELECT ?item (SAMPLE(?coordinates) AS ?coordinates) (SAMPLE(?image) AS ?image) (sample(?lat1) as ?lat1) (sample(?lon1) as ?lon1) (sample(?opening) as ?opening) WHERE {
?item wdt:[property:instance of] wd:[entity:London Underground station] .
?item wdt:[property:coordinate location] ?coordinates .
?item p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLatitude ?lat1 .
?item p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLongitude ?lon1 .
OPTIONAL { ?item wdt:[property:image] ?image }.
OPTIONAL { ?item wdt:[property:date of official opening] ?opening }.
} GROUP BY ?item
} AS %stations
WITH {
SELECT ?nextstation (sample(?lat2) as ?lat2) (sample(?lon2) as ?lon2) WHERE {
?nextstation wdt:[property:instance of] wd:[entity:London Underground station] .
?nextstation p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLatitude ?lat2 .
?nextstation p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLongitude ?lon2 .
} GROUP BY ?nextstation
} AS %nextstations
WITH {
SELECT ?line ?connect ?rgb WHERE {
INCLUDE %stations .
INCLUDE %nextstations .
?item p:[property:adjacent station] ?nextstationstatement .
?nextstationstatement ps:[property:adjacent station] ?nextstation .
?nextstationstatement pq:[property:connecting line] ?connect . ?connect wdt:[property:part of] wd:[entity:London Underground] .
?connect wdt:[property:sRGB color hex triplet] ?rgb .
FILTER(STR(?item) < STR(?nextstation)) .
BIND(CONCAT('LINESTRING (', STR(?lon1), ' ', STR(?lat1), ',', STR(?lon2), ' ', STR(?lat2), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line)
}
} AS %lines
WHERE {
{ INCLUDE %stations } UNION { INCLUDE %lines } .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?gender ?genderLabel ?count WITH {
SELECT ?gender (COUNT(?depicted) AS ?count) WHERE {
?work wdt:[property:depicts] ?depicted.
?depicted # wdt:[property:instance of] wd:[entity:human];
wdt:[property:sex or gender] ?gender.
}
GROUP BY ?gender
} AS %results WHERE {
INCLUDE %results.
FILTER(!ISBLANK(?gender))
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY DESC(?count)
# (note that this query doesn't group any genders together automatically, but when using this data,
# you should probably do so manually - e. g. include transgender <gender> in the numbers for <gender>, in accordance with their "subclass of" statements)

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX schema: <http://schema.org/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?person ?personLabel ?LibrisXL (?article as ?Wikipedia) ?SBL ?Trans ?img (count(?links) as ?linkcount)
{
?person wdt:[property:Dictionary of Swedish Translators ID] ?Transid.
OPTIONAL {?person wdt:[property:Dictionary of Swedish National Biography ID] ?SBLid}
BIND(URI(CONCAT("https://litteraturbanken.se/%C3%B6vers%C3%A4ttarlexikon/artiklar/",?Transid)) AS ?Trans)
BIND(URI(CONCAT("https://sok.riksarkivet.se/sbl/Presentation.aspx?id=",?SBLid)) AS ?SBL)
minus {?person wdt:[property:Libris-URI] ?Librisid}
BIND(URI(CONCAT("https://libris.kb.se/katalogisering/search/libris?_limit=100&q=",?Librisid)) AS ?LibrisXL)
?person wdt:[property:instance of] wd:[entity:human].
OPTIONAL {?person wdt:[property:date of birth] ?birthDate}
{?person wdt:[property:date of death] ?diedDate}
{?person wdt:[property:image] ?img}
?links schema:about ?person.
OPTIONAL {?article schema:about ?person;
schema:isPartOf <https://sv.wikipedia.org/>}
OPTIONAL {?article schema:about ?person;
schema:isPartOf <https://en.wikipedia.org/>}
SERVICE wikibase:label { bd:serviceParam wikibase:language "sv,en". }
}
group by ?person ?personLabel ?LibrisXL ?article ?SBL ?Trans ?img
order by desc(?linkcount)

