PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?occupationLabel ?women ?men WITH {
SELECT ?occupation (SUM(?woman) AS ?women) (SUM(?man) AS ?men) WHERE {
BIND(wd:[entity:United States of America] AS ?country). # substitute country of your choice here (remove the [entity:United States of America], hit Ctrl+Space and start typing the country name, select the right one from the suggestions with the arrow keys and insert it with Enter)
?person wdt:[property:instance of] wd:[entity:human];
wdt:[property:country of citizenship] ?country; # remove this to search world-wide - results in query timeout unless you reduce the dataset in some other fashion
p:[property:occupation]/ps:[property:occupation] ?occupation.
{ ?person wdt:[property:sex or gender] wd:[entity:male]. BIND(1 AS ?man). } UNION
{ ?person wdt:[property:sex or gender] wd:[entity:trans man]. BIND(1 AS ?man). } UNION
{ ?person wdt:[property:sex or gender] wd:[entity:female]. BIND(1 AS ?woman). } UNION
{ ?person wdt:[property:sex or gender] wd:[entity:trans woman]. BIND(1 AS ?woman). }
# TODO consider how to count [property:sex or gender]: Q48270 (genderqueer) and Q1097630 (intersex)
}
GROUP BY ?occupation
} AS %results WHERE {
INCLUDE %results. # subquery as optimization: don't make the label service fetch labels for every ?person in the subquery
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}
ORDER BY
# divide ?variable+1 instead of ?variable to avoid division by zero
# (unfortunately, we can't use ABS(LOG(x/y)) instead of the IF() because SPARQL has no LOG function)
DESC(IF(?women > ?men, (?women+1)/(?men+1), (?men+1)/(?women+1)))
# if the ratio is the same, show results with more people in total first
DESC(?women+?men)

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT ?award (SAMPLE(?label) AS ?awardLabel) ?women ?men WITH {
SELECT ?award (SUM(?woman) AS ?women) (SUM(?man) AS ?men) WHERE {
?person wdt:[property:instance of] wd:[entity:human];
p:[property:award received]/ps:[property:award received] ?award.
{ ?person wdt:[property:sex or gender] wd:[entity:male]. BIND(1 AS ?man). } UNION
{ ?person wdt:[property:sex or gender] wd:[entity:trans man]. BIND(1 AS ?man). } UNION
{ ?person wdt:[property:sex or gender] wd:[entity:female]. BIND(1 AS ?woman). } UNION
{ ?person wdt:[property:sex or gender] wd:[entity:trans woman]. BIND(1 AS ?woman). }
}
GROUP BY ?award
HAVING(
# more women than men
?women > ?men &&
# but exclude women-only awards
?men > 0
)
} AS %results WHERE {
INCLUDE %results.
OPTIONAL { ?award wdt:[property:official name] ?officialName. }
OPTIONAL { ?award rdfs:label ?enLabel. FILTER(LANG(?enLabel) = "en"). }
OPTIONAL { ?award rdfs:label ?anyLabel. }
BIND(COALESCE(?officialName, ?enLabel, ?anyLabel) AS ?label).
}
GROUP BY ?award ?women ?men
ORDER BY STR(?awardLabel)

