PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT distinct ?item ?itemLabel ?date (GROUP_CONCAT(distinct ?creaLb; separator=" - ") as ?createur) ?img
WHERE {
?item wdt:[property:genre] wd:[entity:art forgery] ;
wdt:[property:creator] ?crea ;
wdt:[property:image] ?img ;
p:[property:creator] [ pq:[property:manner of] wd:[entity:Johannes Vermeer] ] ;
p:[property:inception] ?declarationdate .
OPTIONAL { MINUS {?declarationdate pq:[property:earliest date] ?pasavant }
MINUS {?declarationdate pq:[property:sourcing circumstances] wd:[entity:circa] }
?declarationdate ps:[property:inception] ?dateunique .
BIND (year(?dateunique) AS ?date)}
OPTIONAL { MINUS {?declarationdate pq:[property:earliest date] ?pasavant }
?declarationdate pq:[property:sourcing circumstances] wd:[entity:circa].
?declarationdate ps:[property:inception] ?dateunique .
BIND (CONCAT("c.",STR(year(?dateunique))) AS ?date)}
OPTIONAL { ?declarationdate pq:[property:earliest date] ?pasavant .
?declarationdate pq:[property:latest date] ?pasapres.
BIND (CONCAT(STR(year(?pasavant)),"-",STR(year(?pasapres))) AS ?date)}
?crea rdfs:label ?creaLb . filter (lang(?creaLb) = "fr") .
SERVICE wikibase:label {bd:serviceParam wikibase:language "fr"}
} GROUP BY ?item ?itemLabel ?date ?img

