SELECT ?occupation ?occupationLabel ?homicides ?total ?rate WITH {
SELECT ?occupation (SUM(?homicide) AS ?homicides) (COUNT(?person) AS ?total) WHERE {
?person wdt:[property:instance of] wd:[entity:human];
wdt:[property:occupation] ?occupation;
wdt:[property:manner of death] ?manner.
FILTER(!ISBLANK(?occupation)).
BIND(IF(?manner = wd:[entity:homicide], 1, 0) AS ?homicide).
}
GROUP BY ?occupation
HAVING(?total > 5)
ORDER BY DESC(?homicides/?total)
LIMIT 100
} AS %results WHERE {
INCLUDE %results.
BIND(?homicides/?total AS ?rate).
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}
ORDER BY DESC(?rate) DESC(?total)

