PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?date ?count ?label WITH {
# all MPs with their associated parliament
SELECT DISTINCT ?mp ?parliament WHERE {
?mp wdt:[property:instance of] wd:[entity:human].
{
# new data model: position held - Member of the nth Parliament of the United Kingdom
?mp p:[property:position held]/ps:[property:position held] ?position.
?position wdt:[property:subclass of] wd:[entity:Member of Parliament];
p:[property:subclass of]/pq:[property:parliamentary term]|wdt:[property:parliamentary term] ?parliament.
} UNION {
# old data model: member of - nth Parliament of the United Kingdom
?mp p:[property:member of]/ps:[property:member of] ?parliament.
?parliament wdt:[property:instance of] wd:[entity:parliamentary term in the United Kingdom].
}
}
} AS %MPsWithParliament WITH {
# count of Johns in each parliament
SELECT ?parliament (COUNT(DISTINCT ?mp) AS ?johns) WHERE {
INCLUDE %MPsWithParliament.
?mp wdt:[property:given name] wd:[entity:John].
}
GROUP BY ?parliament
} AS %johns WITH {
# count of women in each parliament
SELECT ?parliament (COUNT(DISTINCT ?mp) AS ?women) WHERE {
INCLUDE %MPsWithParliament.
?mp wdt:[property:sex or gender]/wdt:[property:subclass of]* wd:[entity:female]. # ([property:subclass of]*: include transgender females - non yet, but will probably happen in the future)
}
GROUP BY ?parliament
} AS %women WHERE {
# get ?johns and ?women
INCLUDE %johns.
INCLUDE %women.
# fan out single result
# ?parliament ?johns ?women
# into two results
# ?parliament "Johns" ?johns
# ?parliament "women" ?women
# so the line chart works
VALUES ?label { "Johns"@en "women"@en }
BIND(IF(?label = "Johns"@en, ?johns, ?women) AS ?count)
# get parliament date for the chart
?parliament wdt:[property:inception]|wdt:[property:start time] ?date.
# add labels
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY ?date

