PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?coordinates ?line ?item ?itemLabel ?connectLabel ?image ?code ?rgb
WITH {
SELECT ?item (SAMPLE(?coordinates) AS ?coordinates) (SAMPLE(?image) AS ?image) (sample(?lat1) as ?lat1) (sample(?lon1) as ?lon1) (sample(?code) as ?code) WHERE {
?item wdt:[property:instance of] wd:[entity:tram stop].
?item wdt:[property:located in the administrative territorial entity] wd:[entity:Ulm].
?item wdt:[property:coordinate location] ?coordinates .
?item p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLatitude ?lat1 .
?item p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLongitude ?lon1 .
OPTIONAL { ?item wdt:[property:image] ?image }.
OPTIONAL { ?item wdt:[property:Indian Railways station code] ?code }.
} GROUP BY ?item
} AS %stations
WITH {
SELECT ?nextstation (sample(?lat2) as ?lat2) (sample(?lon2) as ?lon2) WHERE {
?nextstation wdt:[property:instance of] wd:[entity:tram stop] .
?nextstation wdt:[property:located in the administrative territorial entity] wd:[entity:Ulm] .
?nextstation p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLatitude ?lat2 .
?nextstation p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLongitude ?lon2 .
} GROUP BY ?nextstation
} AS %nextstations
WITH {
SELECT ?line ?connect ("9B0058" as ?rgb) WHERE {
INCLUDE %stations .
INCLUDE %nextstations .
?item p:[property:adjacent station] ?nextstationstatement .
?nextstationstatement ps:[property:adjacent station] ?nextstation .
?nextstationstatement pq:[property:connecting line] ?connect .
FILTER(STR(?item) < STR(?nextstation)) .
BIND(CONCAT('LINESTRING (', STR(?lon1), ' ', STR(?lat1), ',', STR(?lon2), ' ', STR(?lat2), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line)
}
} AS %lines
WHERE {
{ INCLUDE %stations } UNION { INCLUDE %lines } .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}

