?item p:[property:given name] ?nameStatement.
MINUS { ?nameStatement pq:[property:end time] ?nameEndTime. }
?nameStatement ps:[property:given name]/wdt:[property:native label] ?name.
FILTER(CONTAINS(?name, ?deadname) && CONTAINS(?title, ?name))
}
