PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?coordinates ?line ?item ?itemLabel ?connectLabel ?image ?code ?rgb
WITH {
SELECT ?item (SAMPLE(?coordinates) AS ?coordinates) (SAMPLE(?image) AS ?image) (sample(?lat1) as ?lat1) (sample(?lon1) as ?lon1) (sample(?code) as ?code) WHERE {
?item wdt:[property:instance of] wd:[entity:tram stop].
?item wdt:[property:located in the administrative territorial entity] wd:[entity:Rio de Janeiro].
?item wdt:[property:coordinate location] ?coordinates .
?item p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLatitude ?lat1 .
?item p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLongitude ?lon1 .
OPTIONAL { ?item wdt:[property:image] ?image }.
OPTIONAL { ?item wdt:[property:Indian Railways station code] ?code }.
} GROUP BY ?item
} AS %stations
WITH {
SELECT ?nextstation (sample(?lat2) as ?lat2) (sample(?lon2) as ?lon2) WHERE {
?nextstation wdt:[property:instance of] wd:[entity:tram stop] .
?nextstation wdt:[property:located in the administrative territorial entity] wd:[entity:Rio de Janeiro] .
?nextstation p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLatitude ?lat2 .
?nextstation p:[property:coordinate location] / psv:[property:coordinate location] / wikibase:geoLongitude ?lon2 .
} GROUP BY ?nextstation
} AS %nextstations
WITH {
SELECT ?line ?connect ("9B0058" as ?rgb) WHERE {
INCLUDE %stations .
INCLUDE %nextstations .
?item p:[property:adjacent station] ?nextstationstatement .
?nextstationstatement ps:[property:adjacent station] ?nextstation .
?nextstationstatement pq:[property:connecting line] ?connect .
FILTER(STR(?item) < STR(?nextstation)) .
BIND(CONCAT('LINESTRING (', STR(?lon1), ' ', STR(?lat1), ',', STR(?lon2), ' ', STR(?lat2), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line)
}
} AS %lines
WHERE {
{ INCLUDE %stations } UNION { INCLUDE %lines } .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],pt,en". }
}

PREFIX hint: <http://www.bigdata.com/queryHints#>
PREFIX schema: <http://schema.org/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT DISTINCT ?book ?commonsCategoryBook ?commonsCategoryAuth
WITH {
SELECT ?book ?auth WHERE {
?book wdt:[property:collection] wd:[entity:British Library Nineteenth Century digitised books collection] .
?book wdt:[property:author]|wdt:[property:contributor to the creative work or subject] ?auth .
}
} AS %pairs
WITH {
SELECT ?auth ?commonsCategoryAuth WHERE {
hint:SubQuery hint:optimizer "None". # we have to disable the optimizer for this subquery because it gets confused by the ?commonsCategoryStatementEn part
INCLUDE %pairs.
OPTIONAL {
?auth wdt:[property:Commons category] ?commonsCategoryStatement.
BIND(STRLANG(CONCAT("Category:", ?commonsCategoryStatement), "en") AS ?commonsCategoryStatementEn)
?commonsCategoryFromStatement schema:name ?commonsCategoryStatementEn;
schema:isPartOf <https://commons.wikimedia.org/>.
}
OPTIONAL {
?commonsCategoryFromSitelink schema:about ?auth;
schema:isPartOf <https://commons.wikimedia.org/>.
FILTER(STRSTARTS(STR(?commonsCategoryFromSitelink), "https://commons.wikimedia.org/wiki/Category:"))
}
BIND(COALESCE(?commonsCategoryFromStatement, ?commonsCategoryFromSitelink) AS ?commonsCategoryAuth)
FILTER(BOUND(?commonsCategoryAuth))
}
} AS %authsWithCommonsCategories
WITH {
SELECT ?book ?commonsCategoryBook WHERE {
hint:SubQuery hint:optimizer "None". # we have to disable the optimizer for this subquery because it gets confused by the ?commonsCategoryStatementEn part
INCLUDE %pairs.
OPTIONAL {
?book wdt:[property:Commons category] ?commonsCategoryStatement.
BIND(STRLANG(CONCAT("Category:", ?commonsCategoryStatement), "en") AS ?commonsCategoryStatementEn)
?commonsCategoryFromStatement schema:name ?commonsCategoryStatementEn;
schema:isPartOf <https://commons.wikimedia.org/>.
}
OPTIONAL {
?commonsCategoryFromSitelink schema:about ?book;
schema:isPartOf <https://commons.wikimedia.org/>.
FILTER(STRSTARTS(STR(?commonsCategoryFromSitelink), "https://commons.wikimedia.org/wiki/Category:"))
}
BIND(COALESCE(?commonsCategoryFromStatement, ?commonsCategoryFromSitelink) AS ?commonsCategoryBook)
FILTER(BOUND(?commonsCategoryBook))
}
} AS %booksWithCommonsCategories
WITH {
SELECT ?book ?auth ?commonsCategoryBook ?commonsCategoryAuth WHERE {
INCLUDE %pairs
INCLUDE %booksWithCommonsCategories.
INCLUDE %authsWithCommonsCategories.
}
} AS %pairCats
WHERE {
INCLUDE %booksWithCommonsCategories
SERVICE <https://query.wikidata.org/bigdata/namespace/categories/sparql> {
?commonsCategoryBook mediawiki:isInCategory ?commonsCategoryAuth .
?commonsCategoryAuth mediawiki:isInCategory <https://commons.wikimedia.org/wiki/Category:People_by_name> .
}
MINUS {
INCLUDE %pairCats
}
}

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX hint: <http://www.bigdata.com/queryHints#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?prop ?propLabel ?prop_items ?prop_stmts ?val ?valLabel ?val_count ?samp ?sampLabel
WITH {
SELECT ?item ?prop ?stmt ?val WHERE {
hint:Query hint:optimizer "None" .
wd:[entity:map] ^wdt:[property:subclass of]*/^wdt:[property:instance of] ?item .
MINUS {?item wdt:[property:instance of] wd:[entity:Wikimedia route diagram]}
?item ?p ?stmt .
?prop wikibase:claim ?p .
?prop wikibase:statementProperty ?ps .
MINUS {
{?prop wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:Wikidata property for an identifier]} # Wikidata property representing a unique identifier
UNION
{?prop wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:Wikidata property for authority control]} # Wikidata property for authority control
}
?stmt ?ps ?val .
} #LIMIT 2000
} AS %maps_props_vals
WITH {
SELECT ?prop (COUNT(DISTINCT(?item)) AS ?prop_items) (COUNT(DISTINCT(?stmt)) AS ?prop_stmts) WHERE {
INCLUDE %maps_props_vals
} GROUP BY ?prop
} AS %prop_stats
WITH {
SELECT ?prop ?val (COUNT(DISTINCT(?item)) AS ?val_count) (SAMPLE(?item) AS ?samp) WHERE {
INCLUDE %maps_props_vals
} GROUP BY ?prop ?val
HAVING (?val_count > 3)
} AS %prop_val_counts
WITH {
SELECT ?prop ?val ?samp ?val_count (COUNT(DISTINCT(?val1)) AS ?val_rank) WHERE {
INCLUDE %prop_val_counts .
{
SELECT ?prop (?val AS ?val1) (?val_count AS ?val1_count) WHERE {
INCLUDE %prop_val_counts
}
}
FILTER (?val1_count >= ?val_count)
} GROUP BY ?prop ?val ?val_count ?samp
} AS %prop_val_ranks
WHERE {
INCLUDE %prop_stats .
INCLUDE %prop_val_ranks .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
FILTER (?val_rank < 6) .
} ORDER BY DESC(?prop_items) DESC(?prop_stmts) ?prop ?val_rank

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX schema: <http://schema.org/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?name ?work_link ?work ?creatorLabel ?date
WITH {
SELECT ?creator WHERE {
VALUES ?citizenship {wd:[entity:United Kingdom] wd:[entity:United Kingdom of Great Britain and Ireland]} . # UK, Britain & Ireland
?creator wdt:[property:Japan Search name ID] []; # Only get things with a Japan Search ID
wdt:[property:country of citizenship] ?citizenship; wdt:[property:occupation] wd:[entity:sculptor]} # sculptors
} AS %creators
WHERE {
include %creators
SERVICE <https://jpsearch.go.jp/rdf/sparql/> {
?jps_creator owl:sameAs ?creator . # convert Wikidata ID to Japan Search ID
?work schema:creator ?jps_creator . # Works by this artist
OPTIONAL {?work schema:name ?name } # This will return separate names in English and Japanese names
OPTIONAL {?work schema:dateCreated ?date}
}
FILTER (lang(?name)="en") # Show only the English name
BIND(URI( REPLACE(STR(?work), "/data/", "/item/") ) AS ?work_link)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
} ORDER BY ?date

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?total ?count ?depicts_class ?depicts_classLabel ?prop ?propLabel ?samp
WITH {
SELECT ?item ?depicts_stmt WHERE {
?item p:[property:depicts] ?depicts_stmt .
} # LIMIT 100000
} AS %stmts
WITH {
SELECT ?prop (COUNT(DISTINCT(?depicts_stmt)) AS ?total) WHERE {
INCLUDE %stmts .
?depicts_stmt ?qual [] .
?prop wikibase:qualifier ?qual .
} GROUP BY ?prop
} AS %totals
WITH {
SELECT ?depicts_class ?prop (COUNT(DISTINCT(?depicts_stmt)) AS ?count) (SAMPLE(?item) AS ?samp) WHERE {
INCLUDE %stmts .
?depicts_stmt ps:[property:depicts] ?depicts_val .
?depicts_val wdt:[property:instance of]? ?depicts_class .
?depicts_stmt ?qual [] .
?prop wikibase:qualifier ?qual .
} GROUP BY ?depicts_class ?prop
ORDER BY DESC(?count)
LIMIT 5000
} AS %data
WITH {
SELECT ?depicts_class ?prop (COUNT(DISTINCT(?depicts_class1)) AS ?rank) WHERE {
INCLUDE %data .
{
SELECT (?depicts_class AS ?depicts_class1) ?prop (?count AS ?count1) WHERE {
INCLUDE %data .
}
}
FILTER (?count1 >= ?count) .
} GROUP BY ?depicts_class ?prop
} AS %ranks
WHERE {
INCLUDE %data .
INCLUDE %ranks .
INCLUDE %totals .
FILTER (?rank < 11) .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
} ORDER BY DESC(?total) ?prop DESC(?count)

PREFIX bd: <http://www.bigdata.com/rdf#>
