}}
GROUP BY ?site ?protection ?country
}
{
?site p:[property:World Heritage Site ID] ?idStatement .
?idStatement ps:[property:World Heritage Site ID] ?id .
FILTER NOT EXISTS { ?idStatement pq:[property:end time] ?x }
wd:[property:World Heritage Site ID] p:[property:formatter URL] ?formatterUrlStatement .
} UNION {
