SELECT DISTINCT ?country1Label ?country2Label ?capital1Label ?capital2Label ?distance WHERE {
{
SELECT DISTINCT ?country1 ?country2 ?capital1 ?capital2 ?distance WHERE {
?country1 p:[property:member of] ?statement1 ;
wdt:[property:capital] ?capital1 .
?statement1 ps:[property:member of] wd:[entity:United Nations] .
FILTER NOT EXISTS { ?statement1 pq:[property:end time] ?x }
FILTER NOT EXISTS { ?country1 wdt:[property:instance of] wd:[entity:historical country] }
?country2 p:[property:member of] ?statement2 ;
wdt:[property:capital] ?capital2 .
?statement2 ps:[property:member of] wd:[entity:United Nations] .
FILTER NOT EXISTS { ?statement2 pq:[property:end time] ?x }
FILTER NOT EXISTS { ?country2 wdt:[property:instance of] wd:[entity:historical country] }
?capital1 wdt:[property:coordinate location] ?coords1 .
?capital2 wdt:[property:coordinate location] ?coords2 .
FILTER(xsd:string(?country1) < xsd:string(?country2))
FILTER NOT EXISTS {
?country1 p:[property:shares border with] ?statementBorder .
?statementBorder ps:[property:shares border with] ?country2 .
{ FILTER NOT EXISTS { ?statementBorder pq:[property:nature of statement] ?x } } UNION
{ ?statementBorder pq:[property:nature of statement] wd:[entity:land boundary] }
}
BIND(ROUND(geof:distance(?coords1, ?coords2)) AS ?distance) .
FILTER (?distance<200)
}
}
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY ?distance

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX geo: <http://www.opengis.net/ont/geosparql#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?point ?line ?par ?parLabel ?sett ?settLabel (?parLabel AS ?layer)
WITH {
SELECT ?par (AVG(?lat) AS ?avg_lat) (AVG(?long) AS ?avg_long) WHERE {
?item wdt:[property:Historic Environment Scotland ID] [] .
?item p:[property:located in the administrative territorial entity] ?adm_stmt .
?adm_stmt pq:[property:object has role] wd:[entity:Scottish civil parish] .
?adm_stmt ps:[property:located in the administrative territorial entity] ?par .
?item p:[property:coordinate location] ?coord_stmt .
?coord_stmt psv:[property:coordinate location]/wikibase:geoLatitude ?lat .
?coord_stmt psv:[property:coordinate location]/wikibase:geoLongitude ?long .
} GROUP BY ?par
} AS %par_data
WITH {
SELECT ?par ?point WHERE {
INCLUDE %par_data
BIND(CONCAT('POINT (', str(?avg_long), ' ', str(?avg_lat), ')') AS ?str)
BIND(STRDT(?str, geo:wktLiteral) AS ?point) .
}
} AS %points
WITH {
SELECT ?sett ?par ?line ?point WHERE {
INCLUDE %par_data
?par wdt:[property:contains settlement] ?sett .
?sett p:[property:coordinate location] ?sett_stmt .
?sett_stmt ps:[property:coordinate location] ?point .
?sett_stmt psv:[property:coordinate location]/wikibase:geoLatitude ?sett_lat .
?sett_stmt psv:[property:coordinate location]/wikibase:geoLongitude ?sett_long .
BIND(CONCAT('LINESTRING (', STR(?sett_long), ' ', STR(?sett_lat), ',', STR(?avg_long), ' ', STR(?avg_lat), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line) .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
} AS %lines
WHERE {
{ INCLUDE %points } UNION { INCLUDE %lines } .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}

