SELECT ?animal ?deLemmas ?frLemmas ?image
WITH {
SELECT ?animal (STRLANG(GROUP_CONCAT(?deLemma; separator = "/"), "de") AS ?deLemmas) (STRLANG(GROUP_CONCAT(?frLemma; separator = "/"), "fr") AS ?frLemmas) WHERE {
?de dct:language wd:[entity:German];
wikibase:lexicalCategory wd:[entity:noun];
wikibase:lemma ?deLemma;
wdt:[property:grammatical gender] wd:[entity:feminine];
ontolex:sense [ wdt:[property:item for this sense] ?animal ].
?fr dct:language wd:[entity:French];
wikibase:lexicalCategory wd:[entity:noun];
wikibase:lemma ?frLemma;
wdt:[property:grammatical gender] wd:[entity:masculine];
ontolex:sense [ wdt:[property:item for this sense] ?animal ].
?animal wdt:[property:subclass of]+ wd:[entity:animal].
}
GROUP BY ?animal
} AS %animals
WITH {
SELECT ?animal ?animalLabel ?deLemmas ?frLemmas WHERE {
INCLUDE %animals.
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
} AS %animalsWithLabels
WHERE {
INCLUDE %animalsWithLabels.
BIND(CONCAT("haswbstatement:[property:depicts]=", STRAFTER(STR(?animal), STR(wd:))) AS ?search)
