SELECT ?degrees_Celsius ?degrees_Fahrenheit ?item ?itemLabel ?location ?locationLabel ?date ?coor ?layer
WHERE
{
?item p:[property:minimum temperature record] ?st .
{
?st psv:[property:minimum temperature record] [ wikibase:quantityAmount ?degrees_Celsius ; wikibase:quantityUnit wd:[entity:degree Celsius] ]
BIND ( ROUND ( ?degrees_Celsius * 1.8 + 32 ) as ?degrees_Fahrenheit )
}
UNION
