BIND( ROUND( ( ?degrees_Fahrenheit - 32 ) / 1.8 * 10)/10 as ?degrees_Celsius )
}
OPTIONAL { ?st pq:[property:location] ?location OPTIONAL { ?location wdt:[property:coordinate location] ?coor0 } }
OPTIONAL { ?st pq:[property:point in time] ?date }
OPTIONAL { ?item wdt:[property:coordinate location] ?coor1 }
BIND( COALESCE(?coor0, ?coor1) as ?coor)
BIND( CONCAT(str(Floor(?degrees_Celsius / 10)),"0s degC") as ?layer)
SERVICE wikibase:label { bd:serviceParam wikibase:language "en" }
}
ORDER BY ASC(?degrees_Celsius)
LIMIT 1000

