wdt:[property:place of publication] ?pop .
OPTIONAL { ?print wdt:[property:image] ?image .}
?pop wdt:[property:coordinate location] ?popCoords .
?pop p:[property:coordinate location] [ ps:[property:coordinate location] []; psv:[property:coordinate location] [ wikibase:geoLongitude ?poplon; wikibase:geoLatitude ?poplat; ] ].
$print p:[property:main subject] ?printstmt .
