PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT
?author1 ?author1Label ?image1 ?rgb
?author2 ?author2Label ?image2
WITH {
SELECT
?author1 (SAMPLE(?image1_) AS ?image1)
?author2 (SAMPLE(?image2_) AS ?image2)
(SAMPLE(?rgb_) AS ?rgb)
WHERE {
?work wdt:[property:author] ?author1 , ?author2 ;
wdt:[property:published in] wd:[entity:Journal of Cheminformatics] .
# Only display co-authorship for certain types of documents
# Journal and conference articles, books, not (yet?) software
VALUES ?publication_type { wd:[entity:scholarly article] wd:[entity:book] wd:Q26973022 wd:[entity:blog post] wd:[entity:research proposal] }
FILTER EXISTS { ?work wdt:[property:instance of] ?publication_type . }
# No self-links.
FILTER (?author1 != ?author2)
# Images
OPTIONAL { ?author1 wdt:[property:image] ?image1_ }
OPTIONAL { ?author2 wdt:[property:image] ?image2_ }
# Coloring of the nodes
BIND("FFFFFF" AS ?rgb_)
}
GROUP BY ?author1 ?author2
} AS %result
WHERE {
INCLUDE %result
SERVICE wikibase:label { bd:serviceParam wikibase:language "en,da,de,es,fr,jp,sv,ru,zh".
}
}

