PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?cds ?line ?item ?itemLabel ?layer
WITH {
SELECT ?item ?cds ?lat1 ?lon1 ?layer WHERE {
?item wdt:[property:country] wd:[entity:India]; wdt:[property:coordinate location] ?cds ; wdt:[property:twinned administrative body] [].
?item p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLatitude ?lat1 .
?item p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLongitude ?lon1 .
?item rdfs:label ?nl. FILTER(LANG(?nl)="en")
BIND(?nl as ?layer)
}
} AS %stations
WITH {
SELECT ?line ?layer WHERE {
INCLUDE %stations .
?item wdt:[property:twinned administrative body] ?ns.
?item rdfs:label ?nl. FILTER(LANG(?nl)="en")
?ns p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLatitude ?lat2 .
?ns p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLongitude ?lon2 .
BIND(CONCAT('LINESTRING(', STR(?lon1), ' ', STR(?lat1), ',', STR(?lon2), ' ', STR(?lat2), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line)
BIND(?nl as ?layer)
}
} AS %lines
WHERE {
{ INCLUDE %stations } UNION { INCLUDE %lines } .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
} #

