PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?item ?itemLabel ?born ?parent ?parentLabel ?parentdied ?days_posthumous WITH {
SELECT DISTINCT ?item ?born ?parent ?parentdied ?days_posthumous WHERE {
?item wdt:[property:instance of] wd:[entity:human] . # people only, avoid racehorses!
# add an additional generator here if desired, ie "Swedish people" # ?item wdt:[property:country of citizenship] wd:[entity:Sweden]
?item wdt:[property:mother]|wdt:[property:father] ?parent . ?item wdt:[property:date of birth] ?born .
?parent wdt:[property:date of death] ?parentdied . filter(?parentdied < ?born) .
bind(round((?born-?parentdied)) as ?days_posthumous) . filter(?days_posthumous > 365) .
# filter to just those that are over a year different
# remember that some people can be born the year after their father died!
}
} AS %results WHERE {
INCLUDE %results.
?item p:[property:date of birth] [ a wikibase:BestRank; psv:[property:date of birth] [ wikibase:timeValue ?born; wikibase:timePrecision ?prec1 ] ] .
?parent p:[property:date of death] [ a wikibase:BestRank; psv:[property:date of death] [ wikibase:timeValue ?parentdied; wikibase:timePrecision ?prec2 ] ] .
filter (?prec1 >= 9) . filter (?prec2 >= 9)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
} order by desc(?born)

