SELECT
?author1 ?author1Label (SAMPLE(?image1_) AS ?image1) ?rgb
?author2 ?author2Label (SAMPLE(?image2_) AS ?image2)
WITH {
SELECT
?vortrag1 ?author1
(SAMPLE(?dark_rgb_) AS ?dark_rgb)
(SAMPLE(?light_rgb_) AS ?light_rgb)
WHERE {
# Find people at the event
{
?vortrag1 wdt:[property:part of] wd:[entity:#vBIB20]; wdt:[property:author] ?author1 .
BIND ("EEEEEE" AS ?dark_rgb_)
}
}
GROUP BY ?author1 ?vortrag1
} AS %authors
WITH {
SELECT DISTINCT ?author1 ?author2 ?rgb WHERE {
INCLUDE %authors
#wd:[entity:#vBIB20] (wdt:[property:speaker] | wdt:[property:organizer] | ^wdt:[property:participant in] | wdt:[property:participant] | ^wdt:[property:is proceedings from] / ^wdt:[property:published in] / wdt:[property:author]) ?author2 .
# Find co-authors on #vBIB
?vortrag2 wdt:[property:part of] wd:[entity:#vBIB20]; wdt:[property:author] ?author2 .
FILTER (?author1 != ?author2)
FILTER (?vortrag1 = ?vortrag2)
BIND(COALESCE(?dark_rgb, ?light_rgb) AS ?rgb)
}
} AS %result
WHERE {
INCLUDE %result
