SELECT DISTINCT ?region ?regionLabel ?country ?countryLabel ?area ?population ?density ?coords
WHERE
{
?region wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:first-level administrative division] ;
wdt:[property:country] ?country ;
wdt:[property:population] ?population ;
p:[property:area]/psv:[property:area] [
wikibase:quantityAmount ?baseArea ;
wikibase:quantityUnit [
p:[property:conversion to SI unit]/psv:[property:conversion to SI unit] [
wikibase:quantityAmount ?unitArea;
wikibase:quantityUnit wd:[entity:square metre]
]
]
] ;
wdt:[property:coordinate location] ?coords .
FILTER NOT EXISTS { ?region wdt:[property:dissolved, abolished or demolished date] ?x }
BIND(?baseArea * ?unitArea / 1000000 AS ?area) .
FILTER ( ?area > 0 )
FILTER ( ?population > 0 )
BIND ((?population / ?area) AS ?density)
FILTER ( ?density < 30 )
?country wdt:[property:continent] wd:[entity:Europe] .
FILTER NOT EXISTS { ?country wdt:[property:country] wd:[entity:historical country] }
FILTER NOT EXISTS { ?country wdt:[property:dissolved, abolished or demolished date] ?x }
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY ?density ?countryLabel ?regionLabel

