SELECT distinct ?parliament_start (round((?johns/?members)*100) as ?percent_johns) where
{
{ SELECT distinct ?term ?parliament_start where
{ { ?term wdt:[property:subclass of] wd:[entity:Member of Parliament] } union { ?term wdt:[property:subclass of] wd:[entity:Member of Parliament of Great Britain] } union { ?term wdt:[property:subclass of] wd:[entity:Member of Parliament in the Parliament of England] }
optional { ?term wdt:[property:inception] ?parliament_start }
}
}
optional { SELECT ?term (count(distinct ?item) as ?members) where
{ ?item p:[property:position held] ?positionStatement . ?positionStatement ps:[property:position held] ?term .
{ ?term wdt:[property:subclass of] wd:[entity:Member of Parliament] } union { ?term wdt:[property:subclass of] wd:[entity:Member of Parliament of Great Britain] } union { ?term wdt:[property:subclass of] wd:[entity:Member of Parliament in the Parliament of England] }
# ?item wdt:[property:given name] ?name #has a known forename
} group by ?term
}
optional { SELECT ?term (count(distinct ?item) as ?johns) where
{ ?item p:[property:position held] ?positionStatement . ?positionStatement ps:[property:position held] ?term .
{ ?term wdt:[property:subclass of] wd:[entity:Member of Parliament] } union { ?term wdt:[property:subclass of] wd:[entity:Member of Parliament of Great Britain] } union { ?term wdt:[property:subclass of] wd:[entity:Member of Parliament in the Parliament of England] }
?item wdt:[property:given name] wd:[entity:John] # that name is John
} group by ?term
}
filter ( ?members >= 25 ) # only terms with 25 or more people
