PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX gas: <http://www.bigdata.com/rdf/gas#>

SELECT ?item ?itemLabel ?depth1 ?depth2 ?depth WITH{
SELECT ?item ?depth1 ?depth2 WHERE
{
{
SERVICE gas:service
{
gas:program gas:gasClass "com.bigdata.rdf.graph.analytics.SSSP" ; gas:in wd:[entity:George Washington] ; gas:traversalDirection "Reverse" ; gas:out ?item ;gas:out1 ?depth1 ; gas:maxIterations 1000 ; gas:linkType wdt:[property:child] .
}
}
{
SERVICE gas:service
{
gas:program gas:gasClass "com.bigdata.rdf.graph.analytics.SSSP" ; gas:in wd:[entity:George W. Bush] ; gas:traversalDirection "Reverse" ; gas:out ?item ;gas:out1 ?depth2 ; gas:maxIterations 1000 ; gas:linkType wdt:[property:child] .
}
}
} } AS %1 WITH {SELECT (?item2 AS ?item1) {INCLUDE %1. ?item2 wdt:[property:child] ?item.}} AS %2
WHERE {
INCLUDE %1.
FILTER NOT EXISTS {SELECT (?item1 AS ?item) {INCLUDE %2.}}
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
BIND(?depth1+?depth2 AS ?depth)
} ORDER BY ?depth

