INCLUDE %data .
} GROUP BY ?country ?name
} AS %counts WITH {
SELECT ?country (MAX(?pocet) AS ?max) {
INCLUDE %counts .
} GROUP BY ?country
} AS %best WHERE {
INCLUDE %counts .
INCLUDE %best .
FILTER( ?max = ?pocet ) .
?name rdfs:label ?nameLabel filter(lang(?nameLabel)="en").
?country wdt:[property:geoshape] ?shape .
BIND((?nameLabel) as ?layer ).
}

