OPTIONAL{?st pq:[property:nature of statement] ?noc. ?noc rdfs:label ?nature_of_statement. FILTER(LANG(?nature_of_statement)="en")}
OPTIONAL{?item wdt:[property:publication date] ?date}
OPTIONAL{?item wdt:[property:country of origin] ?country. ?country rdfs:label ?country_label. FILTER(LANG(?country_label)="en")}
