{ ?item p:[property:cast member] ?cs . ?cs ps:[property:cast member] ?caesar . ?cs pq:[property:character role] ?version . ?version wdt:[property:fictional or mythical analog of] wd:[entity:Julius Caesar]. }
# played Caesar, or played a character based on him
