SELECT DISTINCT (SAMPLE(REPLACE(STR(?continent), ".*Q", "Q")) AS ?continent) (SAMPLE(?memberEU) AS ?memberEU) (SAMPLE(?democracy) AS ?democracy) ?country (REPLACE(STR(?country), ".*Q", "Q") AS ?qid) ?countryLabel ?population ?ISO3166_1 ?nominalGDPperCapita ?PPP_GDP_per_capita ?Human_Development_Index WHERE {
