wdt:[property:population] ?population.
OPTIONAL { ?country wdt:[property:ISO 3166-1 alpha-3 code] ?ISO3166_1. }
OPTIONAL { ?country wdt:[property:nominal GDP per capita] ?nominalGDPperCapita. }
OPTIONAL { ?country wdt:[property:PPP GDP per capita] ?PPP_GDP_per_capita. }
OPTIONAL { ?country wdt:[property:Human Development Index] ?Human_Development_Index. }
BIND (exists{?country wdt:[property:member of] wd:[entity:European Union]} AS ?memberEU)
BIND (exists{?country wdt:[property:basic form of government]/wdt:[property:subclass of]* wd:[entity:democracy]} AS ?democracy)
{?country wdt:[property:continent] ?continent}
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}
GROUP BY ?population ?countryLabel ?country ?ISO3166_1 ?nominalGDPperCapita ?PPP_GDP_per_capita ?Human_Development_Index

PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX geo: <http://www.opengis.net/ont/geosparql#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?item ?itemLabel ?img ?georef ?proportion ?coords ?line ?rgb ?layer
WITH {
SELECT ?item ?img ?georef ?coords ?lat ?lon WHERE {
?item wdt:[property:collection] wd:[entity:Ordnance Survey Drawings] .
?item p:[property:coordinates of geographic center] ?coord_stmt .
OPTIONAL {?item wdt:[property:external georeferencing URL] ?georef} .
OPTIONAL {?item wdt:[property:image] ?img} .
?coord_stmt ps:[property:coordinates of geographic center] ?coords .
?coord_stmt psv:[property:coordinates of geographic center] / wikibase:geoLatitude ?lat .
?coord_stmt psv:[property:coordinates of geographic center] / wikibase:geoLongitude ?lon .
}
} AS %points
WITH {
SELECT ?line ?layer ?rgb WHERE {
INCLUDE %points .
?item wdt:[property:shares border with] ?item2 .
?item2 p:[property:coordinates of geographic center] ?coord2_stmt .
?coord2_stmt psv:[property:coordinates of geographic center] / wikibase:geoLatitude ?lat2 .
?coord2_stmt psv:[property:coordinates of geographic center] / wikibase:geoLongitude ?lon2 .
BIND(CONCAT('LINESTRING (', STR(?lon), ' ', STR(?lat), ',', STR(?lon2), ' ', STR(?lat2), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line) .
BIND('adjacent' AS ?layer) .
BIND('FF0000' AS ?rgb) .
}
} AS %lines
WITH {
SELECT ?line ?layer ?rgb ?proportion WHERE {
INCLUDE %points .
?item p:[property:territory overlaps] ?stmt .
?stmt ps:[property:territory overlaps] ?item2 .
OPTIONAL {?stmt pq:[property:proportion] ?prop1} .
OPTIONAL {?item2 p:[property:territory overlaps] ?stmt2 . ?stmt2 ps:[property:territory overlaps] ?item . ?stmt2 pq:[property:proportion] ?prop2}
BIND(IF(bound(?prop2) && bound(?prop1) && (?prop2 > ?prop1), ?prop2, ?prop1) AS ?prop) .
BIND(COALESCE(?prop, ?prop1, ?prop2) AS ?proportion) .
?item2 p:[property:coordinates of geographic center] ?coord2_stmt .
?coord2_stmt psv:[property:coordinates of geographic center] / wikibase:geoLatitude ?lat2 .
?coord2_stmt psv:[property:coordinates of geographic center] / wikibase:geoLongitude ?lon2 .
BIND(CONCAT('LINESTRING (', STR(?lon), ' ', STR(?lat), ',', STR(?lon2), ' ', STR(?lat2), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line) .
BIND('overlap' AS ?layer)
BIND('0000AA' AS ?rgb) .
}
} AS %lines2
WHERE {
{ INCLUDE %lines }
UNION
{ INCLUDE %lines2 }
UNION
{ INCLUDE %points . BIND('points' AS ?layer) . BIND('FF0000' AS ?rgb)} .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}

