PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX geo: <http://www.opengis.net/ont/geosparql#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?line ?ns ?nsLabel ?connect ?connectLabel (?connectLabel as ?layer)
WITH {
SELECT ?item (sample(?lat1) as ?lat1) (sample(?lon1) as ?lon1) WHERE {
?item wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:railway station]; wdt:[property:coordinate location] ?cds. MINUS { ?item wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:metro station] }
{?item wdt:[property:country] wd:[entity:India]}
?connect wdt:[property:instance of] wd:[entity:train service] ; wdt:[property:country] wd:[entity:India] ; wdt:[property:start point] wd:[entity:Howrah railway station] .
?item wdt:[property:connecting service] ?connect.
?item p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLatitude ?lat1 .
?item p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLongitude ?lon1 .
} GROUP BY ?item
} AS %stations
WITH {
SELECT ?line ?connect ?ns WHERE {
INCLUDE %stations .
?item p:[property:connecting service] [ ps:[property:connecting service] ?connect ; pq:[property:followed by] ?ns ] .
?connect wdt:[property:instance of] wd:[entity:train service] ; wdt:[property:country] wd:[entity:India] ; wdt:[property:start point] wd:[entity:Howrah railway station] .
?ns p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLatitude ?lat2 .
?ns p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLongitude ?lon2 .
BIND(CONCAT('LINESTRING(', STR(?lon1), ' ', STR(?lat1), ',', STR(?lon2), ' ', STR(?lat2), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line)
}
} AS %lines
WHERE {
{ INCLUDE %lines }.
SERVICE wikibase:label { bd:serviceParam wikibase:language "bn,en". ?connect rdfs:label ?connectLabel. ?ns rdfs:label ?nsLabel}
} ORDER BY ?connectLabel

