PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?misto_narozeni ?misto_umrti ?line WITH {
SELECT ?item ?misto_narozeni ?misto_umrti where {
?item wdt:[property:place of birth]/wdt:[property:country] wd:[entity:Czech Republic] .
?item wdt:[property:place of death]/wdt:[property:country] wd:[entity:Czech Republic] .
?item wdt:[property:place of birth]* ?misto_narozeni . ?misto_narozeni wdt:[property:instance of] wd:[entity:municipality of the Czech Republic] .?misto_narozeni wdt:[property:population] ?obyvatele filter(?obyvatele > 2500 ) .
?item wdt:[property:place of death]* ?misto_umrti . ?misto_umrti wdt:[property:instance of] wd:[entity:municipality of the Czech Republic] filter(?misto_narozeni != ?misto_umrti).
}
} AS %data WITH {
SELECT ?misto_narozeni ?misto_umrti (COUNT(?item) AS ?pocet) {
INCLUDE %data .
} GROUP BY ?misto_narozeni ?misto_umrti
} AS %counts WITH {
SELECT ?misto_narozeni (MAX(?pocet) AS ?nej) {
INCLUDE %counts .
} GROUP BY ?misto_narozeni
} AS %best WHERE {
INCLUDE %counts .
INCLUDE %best .
?misto_narozeni p:[property:coordinate location] [ ps:[property:coordinate location] []; psv:[property:coordinate location] [ wikibase:geoLongitude ?coord1lon; wikibase:geoLatitude ?coord1lat; ] ].
?misto_umrti p:[property:coordinate location] [ ps:[property:coordinate location] []; psv:[property:coordinate location] [ wikibase:geoLongitude ?coord2lon; wikibase:geoLatitude ?coord2lat; ] ].
BIND(CONCAT('LINESTRING (', STR(?coord1lon), ' ', STR(?coord1lat), ',', STR(?coord2lon), ' ', STR(?coord2lat), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line)
FILTER( ?nej = ?pocet ) .
} order by asc(?misto_narozeni)

