PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

select distinct ?itemLabel ?size ?percentage_online ?rgb where {
?item wdt:[property:country] wd:[entity:Czech Republic] .
?item p:[property:collection or exhibition size] ?statement.
?statement ps:[property:collection or exhibition size] ?size ;
pq:[property:point in time] ?date filter(year(?date)= 2021 )
minus {?statement pq:[property:applies to part] [] .}
optional {?item p:[property:collection or exhibition size] [ps:[property:collection or exhibition size] ?size_online ; pq:[property:applies to part] wd:[entity:online collection] ; pq:[property:point in time] ?date ] .}
bind ((100 * ?size_online / ?size) as ?percentage_online)
BIND(if
(?percentage_online < 10, "FF0000",
if (?percentage_online < 20, "E21C00",
if (?percentage_online < 30,"C63800",
if (?percentage_online < 40, "AA5500",
if (?percentage_online < 50, "8D7100",
if (?percentage_online < 60, "718D00",
if (?percentage_online < 70, "55AA00",
if (?percentage_online < 80, "38C600",
if (?percentage_online < 90, "1CE200", "00FF00"))))))))) as ?rgb) .
SERVICE wikibase:label { bd:serviceParam wikibase:language "en,cs". }
}

