PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?item ?itemLabel ?itemDescription ?somePositionLabel ?died ?kind WITH {
SELECT ?item (MAX(?died_) AS ?died) (SAMPLE(?kind_) AS ?kind) (SAMPLE(?position) AS ?somePosition) {
hint:SubQuery hint:optimizer "None".
# death in battle or killed in action
{ ?item wdt:[property:manner of death] wd:[entity:death in battle]. BIND("death in battle"@en AS ?kind_) } UNION
{ ?item wdt:[property:cause of death]|wdt:[property:military casualty classification] wd:[entity:killed in action]. BIND("killed in action"@en AS ?kind_) }
# suitable item
?item wdt:[property:instance of] wd:[entity:human];
wdt:[property:date of death] ?died_.
# head of state or government
{
VALUES ?class { wd:[entity:head of government] wd:[entity:head of state] }
?item wdt:[property:position held] ?position.
?position wdt:[property:subclass of]* ?class.
} UNION {
?state wdt:[property:head of government] ?item.
OPTIONAL { ?state wdt:[property:office held by head of government] ?position_. }
BIND(COALESCE(?position_, wd:[entity:head of government]) AS ?position)
} UNION {
?state wdt:[property:head of state] ?item.
OPTIONAL { ?state wdt:[property:office held by head of state] ?position_. }
BIND(COALESCE(?position_, wd:[entity:head of state]) AS ?position)
}
}
GROUP BY ?item ?died_
} AS %results WHERE {
INCLUDE %results.
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY DESC(?died)
LIMIT 100

