PREFIX dct: <http://purl.org/dc/terms/>
PREFIX ontolex: <http://www.w3.org/ns/lemon/ontolex#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wikibase: <http://wikiba.se/ontology#>

select *
with {
select ?lang (count(*) as ?meaningless) {
?l dct:language ?lang;
wikibase:statements "0"^^xsd:integer.
minus { ?l ontolex:sense [] }
} group by ?lang
} as %meaningless
with {
select ?lang (count(*) as ?total) {
?l dct:language ?lang.
} group by ?lang
} as %totals
where {
include %meaningless.
include %totals.
filter (?total >= 10).
bind(?meaningless/?total*100 as ?pc).
?lang rdfs:label ?en filter(lang(?en) = "en").
} order by desc(?pc) desc(?total) ?en

