MINUS { ?aksara wdt:[property:instance of] wd:[entity:Latin-script alphabet].}
MINUS { ?aksara wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:calligraphy].}
OPTIONAL { ?aksara wdt:[property:inception] ?tgl. }
OPTIONAL { ?aksara wdt:[property:image] ?ga. }
