SELECT ?LALabel ?official_website WHERE {
#find all instances of a non-metropolitan county, district, unitary authority or metropolitan borough council
{?LA wdt:[property:instance of] wd:[entity:non-metropolitan county].
}
UNION {?LA wdt:[property:instance of] wd:[entity:non-metropolitan district].
}
UNION {?LA wdt:[property:instance of] wd:[entity:unitary authority area in England].
}
UNION {?LA wdt:[property:instance of] wd:[entity:metropolitan borough council].}
#get all things these are instances of & then get end date for that (i.e. LA is current)
OPTIONAL {?LA p:[property:instance of] ?type.
?type pq:[property:end time] ?end_date.}
#get website
OPTIONAL { ?LA wdt:[property:official website] ?official_website. }
#deduplicate (assumes LA cannot be isntance of both these things at same time)
OPTIONAL { ?LA wdt:[property:instance of] ?instance_of. }
FILTER((((?instance_of = wd:[entity:non-metropolitan district]) || (?instance_of = wd:[entity:unitary authority area in England])) || (?instance_of = wd:[entity:non-metropolitan county])) || (?instance_of = wd:[entity:metropolitan borough council]))
#create value ?test_date. If instance statement had an end date use it, if not use today
BIND(IF(BOUND(?end_date),?end_date,NOW()) AS ?test_date).
#only show LAs with test date today or in future (this means we will show local authorities that exist but are planned to cease in the future)
FILTER(?test_date >= NOW()) .
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }}
ORDER BY (?LALabel)

