      } AS %main 
WHERE
{ hint:Query hint:optimizer "None".    
  INCLUDE %main .
  OPTIONAL { FILTER( ?item = wd:[entity:Filaret] )  BIND(" ==> " as ?here) }
  OPTIONAL { ?item wdt:[property:native label] ?native_label }
  OPTIONAL { ?item wdt:[property:writing system] ?script  }
