PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT distinct ?dec ((?count/?decade_total)*100 as ?percent) ?causeLabel ?count
WITH {
select (str(?decade) as ?dec) ?item ?cause where {
?term wdt:[property:subclass of] wd:[entity:Member of Parliament] . ?item p:[property:position held] ?ps . ?ps ps:[property:position held] ?term .
?ps pq:[property:start time] ?start . ?ps pq:[property:end time] ?end . ?ps pq:[property:end cause] ?cause .
FILTER NOT EXISTS { ?term2 wdt:[property:subclass of] wd:[entity:Member of Parliament] .
?item p:[property:position held] ?ps2 . ?ps2 ps:[property:position held] ?term2 . ?ps2 pq:[property:start time] ?start2 . filter (?ps != ?ps2)
optional { ?ps2 pq:[property:end time] ?end2 } BIND(COALESCE(?end2, ?start2) AS ?check) . filter (?check >= ?end) }
# filter out any where they were still serving later on
bind(year(?end) as ?year) . filter(?year >= 1870) . filter(?year < 2020) . bind((floor(?year/10)*10) as ?decade) .
}
} AS %members
WHERE {
{ SELECT ?dec (count(distinct ?item) as ?count) ?cause where
{ INCLUDE %members } group by ?dec ?cause }
{ SELECT ?dec (count(distinct ?item) as ?decade_total) where
{ INCLUDE %members } group by ?dec }
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
