SELECT DISTINCT ?item ?itemLabel ?countryLabel ?area ?population ?density ?coords
WHERE
{
?item p:[property:instance of] ?statement ;
wdt:[property:country] ?country ;
wdt:[property:coordinate location] ?coords .
?statement ps:[property:instance of]/wdt:[property:subclass of]* wd:[entity:first-level administrative division] .
FILTER NOT EXISTS { ?statement pq:[property:end time] ?x }
FILTER NOT EXISTS { ?country wdt:[property:instance of] wd:[entity:historical country] }
FILTER NOT EXISTS { ?item wdt:[property:dissolved, abolished or demolished date] ?x }
?item p:[property:area] ?areaStatement .
{ FILTER NOT EXISTS { ?areaStatement pq:[property:applies to part] ?x } } #UNION
#{ ?areaStatement pq:[property:applies to part] wd:[entity:whole] }
?areaStatement psv:[property:area] [
wikibase:quantityAmount ?baseArea;
wikibase:quantityUnit [
p:[property:conversion to SI unit]/psv:[property:conversion to SI unit] [
wikibase:quantityAmount ?unitArea;
wikibase:quantityUnit wd:[entity:square metre]
]
]
].
BIND(ROUND(?baseArea * ?unitArea / 1000000) AS ?area) .
FILTER (?area >= 100000)
?item wdt:[property:population] ?population .
BIND(ROUND(100 * ?population / ?area) / 100 AS ?density)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY DESC(?area)

