wdt:[property:applies to jurisdiction] wd:[entity:Scotland] .
MINUS { ?item wdt:[property:instance of] wd:[entity:general lighthouse authority] }
}
UNION
{ ?item wdt:[property:instance of] wd:[entity:state-owned enterprise]; # Public corps (6)
wdt:[property:owned by] wd:[entity:Scottish Government] .
}
