MINUS { ?item wdt:[property:applies to jurisdiction] wd:[entity:England and Wales] }
MINUS { ?item p:[property:applies to jurisdiction] ?js . ?js pq:[property:end time] [] }
}
UNION
{ VALUES ?type { wd:[entity:Scottish unitary authority council] wd:[entity:NHS board] wd:[entity:Health and Social Care Partnership] } # Local authorities (32) + Health boards (14)
?item wdt:[property:instance of] ?type .
}
UNION
{ ?item wdt:[property:part of] wd:[entity:Courts of Scotland] . # Courts (56)
}
MINUS { ?item wdt:[property:dissolved, abolished or demolished date] [] }
OPTIONAL { ?item wdt:[property:instance of] ?type }
