SELECT ?item ?itemLabel ?itemDescription ?location ?rgb ?image WITH {
SELECT $COUNTRY ?north ?east ?south ?west WHERE {
VALUES $COUNTRY { wd:[entity:Ukraine] }
$COUNTRY p:[property:coordinates of northernmost point] [psv:[property:coordinates of northernmost point] [wikibase:geoLatitude ?north]].
$COUNTRY p:[property:coordinates of easternmost point] [psv:[property:coordinates of easternmost point] [wikibase:geoLongitude ?east]].
$COUNTRY p:[property:coordinates of southernmost point] [psv:[property:coordinates of southernmost point] [wikibase:geoLatitude ?south]].
$COUNTRY p:[property:coordinates of westernmost point] [psv:[property:coordinates of westernmost point] [wikibase:geoLongitude ?west]].
} } AS %data
WHERE {
INCLUDE %data
?item wdt:[property:country] $COUNTRY .
?item p:[property:coordinate location] [
ps:[property:coordinate location] ?location ;
psv:[property:coordinate location] [
wikibase:geoLongitude ?longitude;
wikibase:geoLatitude ?latitude;
]
].
OPTIONAL { ?item wdt:[property:image] ?image }
FILTER (?latitude <= ?north && ?latitude >= ?south && ?longitude >= ?west && ?longitude <= ?east)
BIND ( (?north + ?south) / 2 AS ?centre )
BIND ( COALESCE(
IF(?latitude >= ?centre, "0057b7", 1/0),
"ffd700"
) AS ?rgb )
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
LIMIT 10000 # try to increase the limit but might timeout or cause browser to hang when rendering the map

