SELECT ?lang ?count WITH {
SELECT ?work ?label WHERE {
?work wdt:[property:collection]?/wdt:[property:part of]? wd:[entity:Khalili Collections]. # Khalili Collections, or individual collections, or objects within collections
?work (rdfs:label|skos:altLabel) ?label
FILTER(lang(?label) != "en") } } AS %core
WHERE { {
SELECT ?lang (COUNT(?label) AS ?count) WHERE {
INCLUDE %core.
BIND(lang(?label) AS ?langcode).
OPTIONAL { ?language wdt:[property:ISO 639-1 code] ?langcode; rdfs:label ?langname FILTER(lang(?langname) = "en")}
BIND(IF (BOUND(?langname), ?langname, ?langcode) AS ?lang)
} GROUP BY ?lang
} UNION {
SELECT ("TOTAL" AS ?lang) (COUNT(?label) AS ?count) WHERE {
INCLUDE %core.
} }
} order BY DESC(?count) ?lang

