?property p:[property:property constraint] [ a wikibase:BestRank ; ps:[property:property constraint] wd:[entity:allowed-entity-types constraint] ; pq:[property:item of property constraint] wd:[entity:Wikibase lexeme] ] ; p:[property:property constraint] [ a wikibase:BestRank ; ps:[property:property constraint] wd:[entity:lexeme requires language constraint] ; pq:[property:item of property constraint] ?language ] .
FILTER NOT EXISTS {
?property p:[property:property constraint] [ a wikibase:BestRank ; ps:[property:property constraint] wd:[entity:allowed-entity-types constraint] ; pq:[property:item of property constraint] ?otherType ] .
FILTER(?otherType != wd:[entity:Wikibase lexeme]) .
}
FILTER NOT EXISTS {
