SELECT ?from ?fromLabel ?image1 ?to ?toLabel ?image2 ?edgeLabel
WITH {
SELECT ?start ?startimage ?image1 ?from ?prop ?coll WHERE {
VALUES ?start {wd:[entity:Abdülmecid I]}. # Choose person to start with
?start wdt:[property:image] ?startimage.
?from ?rel ?start; wdt:[property:collection] ?coll.
?prop wikibase:directClaim ?rel ; a wikibase:Property.
OPTIONAL {?from wdt:[property:image] ?image1}.
} } as %core
WHERE {
{
SELECT ?from ?image1 (?start AS ?to) (?startimage AS ?image2) (?prop AS ?edge) WHERE {
INCLUDE %core.
} ORDER BY ?coll # put objects from the same collection close together
}
UNION {
SELECT ?from ?image1 (?coll AS ?to) ?image2 (wd:[property:collection] AS ?edge) WHERE {
INCLUDE %core.
OPTIONAL {?coll wdt:[property:image] ?image2}.
}
} UNION {
SELECT ?from ?image1 (?type AS ?to) ("" AS ?image2) (wd:[property:instance of] AS ?edge) WHERE {
INCLUDE %core.
?from wdt:[property:instance of] ?type.
}
}
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en".
?from rdfs:label ?fromLabel. ?edge rdfs:label ?edgeLabel. ?to rdfs:label ?toLabel}
}

