PREFIX dct: <http://purl.org/dc/terms/>
PREFIX ontolex: <http://www.w3.org/ns/lemon/ontolex#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT ?letter (COUNT(?letter) AS ?count) WITH {
SELECT ?l WHERE {
?l a ontolex:LexicalEntry ;
dct:language wd:[entity:English] # English
}} AS %lexemes
WITH { SELECT ?wl {
BIND ( 5 AS ?wl )
}} AS %word_length
WITH { SELECT DISTINCT ?word {
INCLUDE %word_length
INCLUDE %lexemes
?l ontolex:lexicalForm [ontolex:representation ?word ]
BIND (CONCAT("^[a-z]{", STR(?wl), "}$") AS ?r )
FILTER(REGEX(?word, ?r))
}} AS %word_matches
WITH { SELECT DISTINCT ?index WHERE {
INCLUDE %word_length
VALUES ?start { 1 }
BIND (?wl AS ?end)
BIND ( (?end - ?start ) + 1 AS ?x )
?n p:[property:instance of] [
ps:[property:instance of] wd:[entity:natural number] ;
pq:[property:follows] ?prev
] .
?prev wdt:[property:numeric value] ?index .
FILTER (?index > 0 && ?index < ?x + 1)
}
} AS %indices
WHERE {
INCLUDE %word_matches
INCLUDE %indices
VALUES ?letter { "a" "b" "c" "d" "e" "f" "g" "h" "i" "j" "k" "l" "m" "n" "o" "p" "q" "r" "s" "t" "u" "v" "w" "x" "y" "z" }
FILTER (CONTAINS(SUBSTR (?word, ?index, 1 ), ?letter))
}
GROUP BY ?letter
ORDER BY DESC (?count)

