?sea ^wdt:[property:mouth of the watercourse]|^wdt:[property:outflows] ?layer. # ?layer is the river before the sea
?layer wdt:[property:located in the administrative territorial entity]/wdt:[property:located in the administrative territorial entity] wd:[entity:Scotland] . hint:Prior hint:gearing "forward".
}
} as %j
WHERE {
