OPTIONAL {?stmt pq:[property:catalog code] ?code} .
}
OPTIONAL {?stmt pq:[property:broader concept]/p:[property:ESCO Occupation ID]/pq:[property:catalog code] ?c1 . BIND(CONCAT(?c1, ".x") AS ?code)} .
