#defaultView:Map
SELECT DISTINCT ?author ?geo
WITH {
SELECT DISTINCT ?author_ ?author WHERE {
  {
    ?target p:[property:author] ?author_statement ; wdt:[property:published in] wd:[entity:Journal of Cheminformatics] .
    ?author_statement ps:[property:author] ?author_ .
    ?author_ rdfs:label ?author .
    FILTER (LANG(?author) = 'en')
    BIND(CONCAT("../author/", SUBSTR(STR(?author_), 32)) AS ?authorUrl)
    OPTIONAL {
      ?author_statement pq:[property:series ordinal] ?order_ .
      BIND(xsd:integer(?order_) AS ?order)
    }
  }
  UNION
  {
    ?target p:[property:author name string] ?authorstring_statement ; wdt:[property:published in] wd:[entity:Journal of Cheminformatics] .
    ?authorstring_statement ps:[property:author name string] ?author_
    BIND(CONCAT(?author_, " ↗") AS ?author)
    OPTIONAL {
      ?authorstring_statement pq:[property:series ordinal] ?order_ .
      BIND(xsd:integer(?order_) AS ?order)
    }
  }
  FILTER (?order = 1)
}
} AS %AUTHORS WHERE {
  INCLUDE %AUTHORS
  ?author_ ( wdt:[property:employer] | wdt:[property:affiliation] ) / wdt:[property:part of]* ?organization . 
  ?organization wdt:[property:coordinate location] ?geo.
}

