SELECT ?employerLabel ?logoImage ?NoVBIBFix (COUNT(?vbib) AS ?NoVBIB) WITH {
SELECT DISTINCT ?employer ?vbib ?logoImage WHERE {
?vbib wdt:[property:part of the series] wd:[entity:#vBIB].
?presentation wdt:[property:presented in] ?vbib;
wdt:[property:point in time] ?pit.
BIND(YEAR(?pit) AS ?year)
?presentation wdt:[property:author] ?author.
?author p:[property:employer] ?employerStmt.
?employerStmt ps:[property:employer] ?employer.
OPTIONAL { ?employerStmt pq:[property:start time] ?empStart.
}
FILTER (?pit > ?empStart)
OPTIONAL { ?employerStmt pq:[property:end time] ?empEnd.
}
FILTER ((bound(?empEnd) && ?pit < ?empEnd) || (!bound(?empEnd) && ?pit > ?empStart) )
OPTIONAL {?employer wdt:[property:logo image] ?logoImage.}
}
}AS %results
WHERE {
INCLUDE %results.
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
{
SELECT (COUNT(?vbib) AS ?NoVBIBFix) WHERE {
?vbib wdt:[property:part of the series] wd:[entity:#vBIB].
}
}
}
GROUP BY ?employerLabel ?NoVBIBFix ?logoImage
HAVING (COUNT(?vbib)=?NoVBIBFix)

