SELECT DISTINCT ?lighthouse ?lighthouseName ?countryLabel (concat(str(?latitude), ", ", str(?longitude)) AS ?coordinates) ?height ?builtDateLabel ?functionalLabel ?wikipediaUrl
WHERE
{
?lighthouse wdt:[property:instance of] wd:[entity:lighthouse]. # find all instances of lighthouse
?country wdt:[property:continent] wd:[entity:South America]. # find all instances of country in South America
?lighthouse wdt:[property:country] ?country. # find lighthouses in South American countries
OPTIONAL {
?lighthouse wdt:[property:country] ?country.
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}
OPTIONAL {
?lighthouse wdt:[property:coordinate location] ?coordinates.
BIND(xsd:float(STRAFTER(STR(?coordinates), "Point(")) AS ?longitude)
BIND(xsd:float(STRAFTER(STR(?coordinates), " " )) AS ?latitude)
}
OPTIONAL { ?lighthouse wdt:[property:height] ?height. }
OPTIONAL { ?lighthouse wdt:[property:inception] ?builtDate. }
OPTIONAL {
?lighthouse p:[property:published in]/ps:[property:published in] ?wikipediaUrl. # get the English Wikipedia page URL
