OPTIONAL {
?out schema:about/wdt:[property:category's main topic]? ?item .
FILTER NOT EXISTS { ?item wdt:[property:instance of] wd:[entity:Wikimedia category] } # remove category items from results set
OPTIONAL {
?item wdt:[property:coordinate location] ?coords .
}
}
SERVICE wikibase:label { bd:serviceParam wikibase:language 'de' }
