?loc wdt:[property:located in the administrative territorial entity] wd:[entity:Rennes] ;
wdt:[property:named after] ?item ;
wdt:[property:coordinate location] ?coordRennes .
?item wdt:[property:instance of] ?type ; wdt:[property:coordinate location] ?coord .
BIND(ROUND(geof:distance(?coordRennes, ?coord)*10)/10 AS ?dist ).
BIND( IF( ?dist < 400 , "FBB806", IF ( ?dist < 1000 , "DE4710" , IF ( ?dist < 2000 , "DE4710" , "940E0E" ) ) ) AS ?rgb).
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}

