SELECT ?item ?itemLabel ?itemDescription ?depth {
SERVICE gas:service {
gas:program gas:gasClass "com.bigdata.rdf.graph.analytics.SSSP" ;
gas:in wd:[entity:Achaemenes] ;
gas:traversalDirection "Forward" ;
gas:out ?item ;
gas:out1 ?depth ;
gas:linkType wdt:[property:child] .
}
FILTER NOT EXISTS {?item wdt:[property:The Peerage person ID] []}
SERVICE wikibase:label {bd:serviceParam wikibase:language "en" }
}
ORDER BY DESC(?depth)
LIMIT 100

