PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT distinct ?country ?countryLabel ?area
WHERE {
{SELECT distinct ?country WHERE {
?country wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:sovereign state].
} }
MINUS
{SELECT distinct ?country #(COUNT(?river) AS ?cnt)
WHERE {
?river wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:river].
?river p:[property:country] [ps:[property:country] ?country].
} GROUP BY ?country
}
MINUS {?country wdt:[property:instance of] wd:[entity:historical country]}
MINUS {?country wdt:[property:instance of] wd:[entity:historical period]}
MINUS {?country wdt:[property:instance of] wd:[entity:federally recognized Native American tribe in the United States]}
MINUS {?country wdt:[property:instance of] wd:[entity:historical period]}
MINUS {?country wdt:[property:instance of] wd:[entity:colonial empire]}
OPTIONAL {?country wdt:[property:area] ?area}
# MINUS %includes
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY ?area

