PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX geo: <http://www.opengis.net/ont/geosparql#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX gas: <http://www.bigdata.com/rdf/gas#>

SELECT ?station ?stationLabel ?cds ?line ?layer WHERE {
{ SERVICE gas:service {
gas:program gas:gasClass "com.bigdata.rdf.graph.analytics.BFS" ;
gas:in wd:[entity:Umeå Central Station] ; # Umea central station
# gas:target wd:[entity:Didymoteicho railway station] ; # Didymoteicho railway station. From here on, adjacent stations rapidly vanish
gas:out ?station ;
gas:out1 [] ;
gas:out2 ?pred .
gas:program gas:linkType wdt:[property:adjacent station] . } # adjacent station
}
FILTER(?station != wd:[entity:Umeå Central Station])
?pred p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLatitude ?lat1 ;
p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLongitude ?lon1 .
?station p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLatitude ?lat2 ;
p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLongitude ?lon2 .
BIND(CONCAT('LINESTRING(', STR(?lon1), ' ', STR(?lat1), ',', STR(?lon2), ' ', STR(?lat2), ')') AS ?str) .
BIND(STRDT(?str, geo:wktLiteral) AS ?line)
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}

