PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT
?[property:programmed in]
?[property:programmed in]Label
?[property:instance of]
?[property:instance of]Label
?software
?softwareLabel
WITH {
SELECT DISTINCT ?license {
?license wdt:[property:edition or translation of]*/wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:free software license].
}
} AS %0
WITH {
SELECT DISTINCT ?software {
INCLUDE %0.
# "GNU Emacs" (Q1252773) has copyright license "GPLv3+" (Q27016754)
# "GPLv3+" (Q27016754) is en edition or translation of "GNU GPL" (Q7603)
# "GNU GPL" (Q7603) is an instance of "free software license" ([entity:free software license])
{?software wdt:[property:copyright license] ?license}
UNION
# "Vim" is an instance of "free and open-source software" (Q506883)
# "free and open-source software" (Q506883) is a subclass of "free software" ([entity:free software])
{?software wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:free software]}.
}
} AS %1
WITH {
SELECT DISTINCT ?software ?[property:instance of] ?[property:programmed in] {
INCLUDE %1.
?software
wdt:[property:instance of] ?[property:instance of];
wdt:[property:programmed in] ?[property:programmed in].
}
} AS %2
{
INCLUDE %2.
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE]"}
}
ORDER BY
ASC(LCASE(?[property:programmed in]Label))
ASC(LCASE(?[property:instance of]Label))

