PREFIX dct: <http://purl.org/dc/terms/>
PREFIX ontolex: <http://www.w3.org/ns/lemon/ontolex#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

select *
with {
select distinct ?l {
?l dct:language wd:[entity:German];
wikibase:lexicalCategory wd:[entity:noun];
wikibase:lemma ?lemma;
wdt:[property:combines lexemes] ?comb1;
wdt:[property:combines lexemes] ?comb2 filter (?comb1 != ?comb2).
?comb1 wikibase:lemma ?combl1.
optional {
?comb1 ontolex:lexicalForm [
wikibase:grammaticalFeature wd:[entity:combining form];
ontolex:representation ?combf1
]
}
?comb2 wikibase:lemma ?combl2.
bind(concat(replace(coalesce(?combf1, ?combl1), "-$", ""), lcase(replace(?combl2, "^-", ""))) as ?genlemma).
filter(?lemma = ?genlemma).
}
} as %ok
where {
?l dct:language wd:[entity:German];
wikibase:lexicalCategory wd:[entity:noun];
wikibase:lemma ?lemma;
wdt:[property:combines lexemes] ?comb.
?comb wikibase:lemma ?combl.
minus { include %ok }
} order by ?lemma ?comb

PREFIX dct: <http://purl.org/dc/terms/>
PREFIX ontolex: <http://www.w3.org/ns/lemon/ontolex#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wikibase: <http://wikiba.se/ontology#>

select ?feat ?en (count(*) as ?total)
with {
select * {
values ?lexcat { wd:[entity:noun] wd:[entity:proper noun] }
?l dct:language wd:[entity:English];
wikibase:lexicalCategory ?lexcat;
ontolex:lexicalForm ?f.
?f wikibase:grammaticalFeature ?feat.
}
} as %feats
{
include %feats.
?feat rdfs:label ?en filter (lang(?en) = "en").
} group by ?feat ?en order by desc(?total) ?en

